    "capital": "{{Defunct}}\n{| width=\"300\" align=\"right\" style=\"background: rgb(249, 249, 249); margin: 0px 0px 1em 1em; border: 1px solid rgb(170, 170, 170); font-size: 95%; border-collapse: collapse;\" border=\"1\" cellspacing=\"0\" cellpadding=\"4\"\n|+ <big><big>Dual Monarchy of Davetopia and Emiri</big></big> \n|-\n| align=\"center\" colspan=\"2\" | \n{| class=\"FCK__ShowTableBorders\" style=\"background: rgb(249, 249, 249); text-align: center;\" border=\"0\" cellspacing=\"0\" cellpadding=\"2\"\n|-\n| width=\"130\" | File:DualMonarchyFlag.png|200px|DualMonarchyFlag.png\n|}\n\n|-\n| align=\"center\" colspan=\"2\" | 1 January 2010- 5 May 2010\n|-\n| Government: \n| Absolute monarchy\n|-\n| Location: \n| Trussville Sector\n|-\n| Area claimed: \n| 1 acre\n|-\n| Population: \n| 4\n|-\n| Leadership: \n| Dave Gomez and Emilee Richards\n|-\n| Language: \n| English\n|-\n| Demonym: \n| Davetopian or Emirite\n|-\n| Currency: \n| US dollar\n|-\n| Religion: \n| Secular\n|-\n| Succeeded by: \n| Confederation of Awesome\n|}\n\nThe Dual Monarchy of Davetopia and Emiri was a micronation that existed in the Trussville Sector from 1 January 2010, to 5 May 2010. It was disestablished when the monarchy proved ineffective, prompting the government to reform into the Confederation of Awesome.\n\n== History  ==\n\nThe Dual Monarchy was founded on January 1, 2010, by Dave Gomez, and Emilee Richards. Both had an interest in micronationalism, and had tried less legitimate micronations before the foundation of the Dual Monarchy. It declared itself independent, and through royal proclamations, the government and laws of the nation were set up. It expanded to its height of four citizens by March 2010. Interest within the nation was running low, and so the Monarchs decided to reform the government to boost activity in the nation. The Absolute Monarchy was reformed into a directory, which became official with the signing of the Declaration of Confederation on 5 March 2010. During its existence as a micronation, the Dual Monarchy maintained a strict neutrality in all international issues. \n\n== Administrative Divisions  ==\n\nThe nation was divided into two kingdoms, each ruled by a Monarch. Davetopia was further subdivided into two Duchies, one lead by Gomez and another by Nick Brown. The Duchy of Nonsense was given full status as a province of the future Confederation of Awesome.\n\n=== Kingdom of Davetopia  ===\n\nThe Kingdom of Davetopia was one of the two kingdoms of the Dual Monarchy, and was largely dominant, spanning half an acre and consisting of three citizens. For its entire existence, it was lead by Dave I|HRM Dave I, who still holds the title of King of Davetopia in the Davetopia|successor province of the Confederation.\n\n==== Duchy of Awesome  ====\n\nThe Duchy of Awesome was the dominant Duchy of Davetopia, consisting of Davetopia City, the cultural, political, and administrative",
