    "capital": "{{Defunct}}\n{| class=\"wikitable\" border=\"1\" cellpadding=\"4\" style=\"float: right; width: 300px; margin: 0 0 1em 1em; border-collapse: collapse; font-size: 95%;\"\n|+ style=\"font-size: 160%; margin-left: inherit;\" |Sovereign State of<br />Aeterna Lucina\n| colspan=\"2\" align=\"center\" |\n|-\n| colspan=\"2\" align=\"center\" | <small>Motto: none<br />Musical Anthem: none</small>\n|-\n| Type of entity:\n| Micronation\n|-\n| Location:\n| Near Cooma, New South Wales\n|-\n| Area claimed:\n| 14&nbsp;km²\n|-\n| Membership:\n| < 50\n|-\n| Date of foundation:\n| 1970s\n|-\n| Leadership:\n| Supreme Lord Baron Neuman of Kara Bagh<br />(Paul Baron Neuman)\n|-\n| Purported organisational structure:\n| Absolute monarchy\n|-\n| Language:\n| English and German\n|-\n| Currency:\n| Australian Dollar\n|}\n\nThe Sovereign State of Aeterna Lucina (referred to in some court transcripts as the Sovereign Humanitarian Mission State of Aeterna Lucina) was an Australian micronation that existed between the late 1970s until the death of its founder in the 1990s.\n\nThe founder and \"Supreme Lord\" of Aeterna Lucina was one Paul Baron Neuman (originally Paul Robert Neuman until he changed it by deed poll), a German-born pensioner from the northern Sydney beachside suburb of Curl Curl who claimed to have received the title \"Baron Neuman of Kara Bagh\" from the exiled former King Hassan III of Afghanistan. He also claimed to have been awarded over 850 other honours, including Professorships, Doctorates of Philosophy and Divinity, and dozens of chivalric honours, including that of \"Grand Master of the Order of the White Cross\".\n\nAeterna Lucina (apparently named for the Roman goddess of childbirth) was founded in 1978, and initially occupied a property owned by Neuman near Byron Bay. At some point during the 1980s the \"state\" moved temporarily to Neumans Curl Curl residence, before its final relocation to a 14&nbsp;km² rural property near the Snowy Mountains town of Cooma, in southern New South Wales. According to a 1989 television report the Curl Curl residence - known as Vitama - was considered to be the micronations",
