    "capital": "{{Inactive}}{{GCNation|country=Republic of Aerligaerlig.gif|motto= |language=English",
    "currency": "{{Inactive}}{{GCNation|country=Republic of Aerligaerlig.gif|motto= |language=EnglishAdelwin|date_founded=August 23, 2001|population=12|active=",
    "motto": "",
    "contactInfo": ["{{Inactive}}{{GCNation|country=Republic of Aerligaerlig.gif|motto= |language=EnglishAdelwin|date_founded=August 23, 2001|population=12|active= Aers|government=Parliament|leader=Lachlan Powers|animal=Boar|fruit= |drink= }}\n\nAerlig is a micronation that was founded on August 23, 2001, and celebrated its fourth birthday in 2005.\n\nAerlig was founded by Mike Phyle, an ex-Cyberian, who is no longer a citizen of Aerlig. Aerlig is the oldest, continuous non-Ezboard English micronation that does not claim real territory, first using Ikonboard and then moving on to Invision Power Board.\n\nAerlig was kept alive during 2001-03 through the work of three key citizens: Lachlan Powers, Jouker Sendler and Subhadip Sen. Subhadip left in 2003, but Jouker and Lachlan remain citizens, with Lachlan currently the Protector of the Republic.\n\nThe Republic is divided into four states: Auelrict, West Overbrook, Duras and the April Islands. The Parliament of the Republic has given the states some powers over their own internal affairs, although may revoke this power at any time, as was illustrated in the April Islands debacle of early 2005.\n\nAerlig is now a member of the Grand Commonwealth. Aerlig also hosts the headquaters of the intermicronational media firm MZM and sports empire EIFA.\n\n==Government Structure==\n\nAerlig has a unicameral parliament. When there is less than five citizens, Parliament is made up of all of the active citizens in the nation. When the number of active citizens increases above the five-citizen threshold, elections are called. This happened most recently in 2005 when elections were called, as the Republic had reached seven active citizens.\n\nThe Head of Parliament is the Prime Minister, who is appointed by the Protector. The Protector appoints the Member of Parliament who has the support of the largest portion of the Parliament. The Prime Minister appoints Ministers to help carry out the tasks of Government.\n\nThe Protector is the Head of State in the Republic. The current Protector is the Honourable Lachlan Powers, MP.\n\nThe Parliament meets at Statesman House in Adelwin, Aerlig.\n\n==Map of the Republic==\n\nhttp://www.mncentre.net/images/aerlig/aerstates2.png\n\nAerlig is made up of a number of islands. It is split into two distinct sections: the Auelrict islands in the Southern Sea and the main Aerlig archepeligo in the northern basin, near fellow Grand Commonwealth|Commonwealth nations Babkha, Treesia and Karnali.\n\n==Links==\n\n*Aerlish Constitution\n\n*http://aerlig.net/"],
