    "motto": "To Life and Freedom and Democracy!}}\n\nThe Free State of New Manila is a small micronation within the w:Richmond|Richmond, Rhode Island Sector|Rhode Island and is a member state of the United New England Micronations. Despite its name having \"Free State\", it is an independent micronation. The text on the original flag meant \"to Independence from Terrorism by Prince Terry McKeen III!\". The Free State of New Manila broke away from the Dominion of Zeprana and the Grand Principality of Arcadia because its population did not like the monarchy of Terry McKeen III. New Manila is currently a w:Protectorate|protected state of the Republic of Avyanna and Taijana because it was formerly a territory of Avyanna and Taijana and it wants to stay with Avyanna and Taijana but wants to remain independent so its only a protected state. The Emblem and current Flag may have a Crown but New Manila is a Democratic Micronation. The Legislation of the Free State of  New Manila is Based off the Liberian and United States Legislation. \n\n== Etymology ==\nThe Name Free State of New Manila off of the Capital City of New Metro Manila which was Based off the Filipino Capital City of Manila, and the part of \"Free State\" does not mean its a state it is a Free State from Other Micronations in the Rhode Island Sector. Also refereed as the \"5th Republic of Richmondia\" because it was Founded in the same area as Richmondia and founded by the same person.\n\n==History==\nThe Free State of New Manila was Founded by Grant Taylor on 8:50PM June 5 2022 in the Old land of Avyanna and Taijana seceding from the rule of Prince Terry McKeen III to Restore Democracy and at 9PM June 5 2022 Joined the United New England Micronations as a Member state. restoring the Old Avyanna and Taijanan Capital City of New Berlin as the Capital of New Manila and the old Avyanna and Taijanan Constitution. Since New Manila used to be the Republic of Avyanna and Taijana it is currently a w:Protectorate|protected state of the Republic of Avyanna and Taijana because it was formerly a territory of Avyanna and Taijana and it wants to stay with Avyanna and Taijana but wants to remain independent so its only a protected state.\n\n==Foreign relations==\n\n===Micronational recognition===\n{|",
