    "capital": "{{Defunct}}\n{| class=\"wikitable\" cellpadding=\"4\" style=\"float: right; width: 300px; margin: 0.5em 0 1em 1em; border-collapse: collapse; border-right-width:2px; border-bottom-width:2px; font-size: 95%;\" width=\"300\" align=\"right\"\n|+ style=\"font-size: 160%; margin-left: inherit;\" | Keep Watch\n|-\n| align=\"center\" | File:Keep Watch flag 2.png|150px|Flag of Keep Watch\n<br />Flag of Keep Watch\n| align=\"center\" | File:Bewarian_Flag.jpg|150px|The flag of Bewarian\n<br />Flag of Bewarian\n|-\n| colspan=\"2\" align=\"center\" | <small>Motto: Servo Vigilo <br />Translation: To preserve, to be vigilant\n|-\n| Government\n| Parliamentary Constitutional Monarchy  \n|-\n| Official language\n| English / Englisc\n|-\n| Demonym\n| Keepwatchic\n|-\n| Currency\n| Dime (Ð)\n|-\n| National game\n| Chess\n|-\n| Registered citizens\n| Fourteen (14)\n|-\n| Date of foundation\n| 3 February 2009\n|-\n| Location\n| Antarctica\n|}\nKeep Watch is a micronation founded by David Brydon. The mainland is situated between 80˚ S and 85˚ S, with Bewarian territory falling between 75˚ S and the coast of Queen Maud Land, both of which are within the Norwegian claim longitude. These land claims were achieved because both the northern and southern Norwegian claim border remains undefined.  \n\nKeep Watch was established through a loophole in the Antarctic Treaty, and claiming this land as a single entity, not a nation or party. Furthermore, the term \"micronation\" is not defined in the Antarctic Treaty.\nAs is the case with most micronations, Keep Watch is claimed to be a sovereign territory by its government, but has not yet received acknowledgement from other larger nations.\n\nThe formation of Keep Watch is said to be greatly inspired by the micronation of Westarctica.\n\n== History ==\n\nThe original concept for the Antarctic micronation began in 2006, originally under the name of \"Antarctic Brydon Republic\". Beginning January 2009, the interest in the Antarctic micronation was rekindled, and letters were sent to the governments of Argentina, the United Kingdom, the United States, Chile, Australia, Norway, Russia, New Zealand and France; informing them of the land claim. These letters informed them of David Brydons land claim as a single entity and the respect for the Antarctic Treaty.\n\nSince then, Keep Watch has began to fortify its presence in the Antarctic by establishing a private government headquarters in Canada and formulating a deed to the land. Keep Watch is currently strengthening its presence in the micronational community and is receiving recognition from a number of them. The original land claim and deed to the Antarctic territory was signed by David Brydon on the 3rd of February 2009.\n\nA Keep Watch expansion project was started in early May 2009. On the 9th of May, Keep Watch expanded its territorial claim to include the coast of Queen Maud Land, and down to 75˚ S, once again taking advantage of the Norwegian claims undefined borders.\nBewarian is a province of Keep Watch, thus follows under both federal and Keep Watch Crown rule. \n\n\nFile:AMU claims.jpg|thumb|500px|The current territory of Keep Watch (grey) as supported by the Antarctic Micronational Union.\n\n== Territory and Conflicts ==\n\nThe land which Keep Watch has claimed is situated between the South Pole and the undefined border of the Norwegian Antarctic claim. A satellite state has been established in Canada as means of maintaining a permanent population outside of Antarctica and forming a government headquarters. The Keep Watch mainland has a border of approximately 3000&nbsp;km and covers an area of 562500&nbsp;km².\n\nA number of problems concerning the land claim of Keep Watch have risen since the micronation was first conceived, perhaps the most drastic one being the conflict between the land claims of Keep Watch and Finismund, because both of their land claims fell within each others borders.\nOn the 23rd of March 2009, Keep Watch relocated its territory northward to avoid land claim conflicts with Finismund.\n\nOn the 9th of May 2009, Keep Watch expanded its territory to include the land north of 75˚ up to the coast of Queen Maud Land within the Norwegian claim border. The territory consisting of Shackleton, the New Swabia",
