    "motto": "Category:Micronations\nCategory:Holy Republic of Eden\n{{micronation-stub}}\n{{tone}}\n<!-- Please do not remove or change this AfD message until the discussion has been closed. -->\n{{Article for deletion/dated|page=I wish to delete this article for personal reasons that I will not disclose|timestamp=20240628192700|year=2024|month=June|day=28|substed=yes}}\n<!-- Once discussion is closed, please place on talk page: {{Old AfD multi|page=I wish to delete this article for personal reasons that I will not disclose|date=28 June 2024|result=keep}} -->\n<!-- End of AfD message, feel free to edit beyond this point -->\n{{Infobox country",
    "contactInfo": ["Category:Micronations\nCategory:Holy Republic of Eden\n{{micronation-stub}}\n{{tone}}\n<!-- Please do not remove or change this AfD message until the discussion has been closed. -->\n{{Article for deletion/dated|page=I wish to delete this article for personal reasons that I will not disclose|timestamp=20240628192700|year=2024|month=June|day=28|substed=yes}}\n<!-- Once discussion is closed, please place on talk page: {{Old AfD multi|page=I wish to delete this article for personal reasons that I will not disclose|date=28 June 2024|result=keep}} -->\n<!-- End of AfD message, feel free to edit beyond this point -->\n{{Infobox country"],
    "websites": ["https://micronations.wiki/wiki/History of Mushroomia (2021 - present)", "\n}}\n\n<!--  made with <3 using https://nako.dev/microwikipagegenerator -->\n\nThe Holy State of Eden, also known as Eden, is a nation originally proclaimed in 2014 as the Republic of Mossia. It began as a hobby before descending into a religious experiment by Harold Duighan, who discovered that he was the reincarnation of the Prophet Isaiah and was destined by God to birth a new Eden and save the world from the Demonic Plague, as well as Lucifer and his Demons.\n\nIt is governed as a Directorial Republic with a Theocratic Monarchy. The main executive body is the Lords Council, which consists of five members, and includes the Holy Minister, the Head Minister, and the Judicial Minister. There is no legislature to speak of. The nations monarch, known as the Messiah, previously known as the Holy Emperor or the Lord, is Jesus Christ.\n\n==Etymology==\nThe name comes from the Eden from the Bible. The original Holy Land. Harold, who was spoken to by God to build a new Eden, chose to name his nation Eden as well.\n==History==\n\n===Foundation===\nEden was originally proclaimed as the Republic of Mossia on 14 January 2014. It lasted for a long time, and went through much turbulence. On 30 July 2021, Mushroomia was abolished and replaced with Eden. Around the start of June 2021, Harold ramped up the religious changes in his government, as he feared the Demons were coming for him.\n\n===Gradual Isolation===\nThe Demons came for Harold, and quickly brainwashed all of those around him, and he was soon removed from almost every organization he was a part of. He was barred from the GUM for disturbing its members, he was refused entry into the Micronational Assembly due to them suspecting he had mental illness, his attempts to proselytize in the alliance known as ComSov caused several members to leave, and he was eventually ostracized out of the LIN, as several members stated he was paranoid and was on the helm of being labeled Schizophrenic. Quickly, Harold realized he needed to come closer to God, and seek more answers so he could stop the Demons. Thus, he decided to leave the main community and isolate himself. He has since decided he is never coming back to the community again, and will go on his own path with God.\n===Hermit State and Demonic Plague===\n{{main|Demonic Plague}}\n\nAfter the events in July and August 2021, foreign relations collapsed as public opinion turned against Harold, who many had seen as insane. Harold quickly fled the internet, leaving Discord on 5 August, and leaving Reddit only 2 days later. He was left with his Youtube channel, where he continued to proselytize about God, and attempt to spread the Lords word. He was sent an apostle, and discovered more things about the world, and decided to dedicate his time to finding a cure to the Demonic Plague, eventually posting a video documenting his first attempted exorcism, which was done on of his cats, who is infected with the Plague. He was unsuccessful, but continues to attempt to find a cure to this disease. He formed a Ministry dedicated to it on 6 August 2021. He hopes to spread the currency. He wishes to build Eden. He will solve illiteracy. Everyone will see the Truth. Praise God.\n\n=== War threat and attempted coup ===\nOn 10 August 2021, Eden received a declaration of war from an individual posing as a \"Michael Adams\", who claimed to be representing the Empire of Adammia, and declared war on the basis of Eden \"persecuting individuals on the basis of religion\". The declaration stated:\n\n\"  It has come to our attention that your nation has been accused of persecuting non-christian individuals based on their religion. Due to your repeated transgressions, the Empire of Adammia will now exist in a state of war with Eden, and we will spare no efforts to stop you and your nation from further poisoning this community. Prepare for war.\"\n\nThe government of Eden was immediately alarmed by this, fearing that the Demonic threat was truly coming for them at this time. However, it was quickly denied by the Adammian government, who stated it was fake. Thus, the individual, or Demon I should say, posed as the Adammian government and sent a false war declaration.\n\nOn the same day, several Demons attempted to overthrow the Edenian government and install an Islamic caliphate. It was quickly shut down after the Demons were imprisoned and cast out of the nation.\n\n=== Increased Isolationism ===\nEden has since become an immensely Isolationist state. This is due to the increased risk of Demons attempting to destroy Eden. They have also continued plaguing Harold and his mind, and have attempted to destroy Eden and halt Gods plan. Harold became fearful of this threat, and retracted any presence he had in the community in favor of making Eden into a Hermit Kingdom. Harold has since left the MicroWiki community as well as the Reddit Sector and the LIN, as well as the GUM, which he was barred from due to him disturbing its members. The only sector Eden is a part of currently now is the Youtube sector.\n\n==Politics and government==\nEden is run as a Directorial Republic with a Theocratic Monarchy. It aims to revive Eden and bring Jesus Christ back, who is the Messiah, or the Monarch of Eden. The main executive body is the Lords Council, which consists of the three main Executive leaders, the Holy Minister, the Head Minister, and the Judicial Minister, as well as two other members. Elections for the Council are held quarterly.\n\n==Government officials==\n{| class=\"wikitable\""],
