    "contactInfo": ["{{Short description|Micronation}}\n{{Infobox country"],
    "websites": ["https://micronations.wiki/wiki/Isle of Lithua", "https://lithua.weeblysite.com Government Website\n}}\nFile:Lithua island.jpg|thumb|The land of The Isle of Lithua\nThe Kingdom of Lithua, commonly known as Lithua is a micronation that claims an island in the river Irfon. It is not recognised by any macronational country or government. Although it is recognised by several other micronations and micronational entities. Most notably the Principality of Aigues-Mortes,\nGrand Duchy of Flandrensis and Empire of Stomaria.\n\nThe micronation mainly focuses on wildlife conservation and raising awareness of the preservation of riparian habitats. Thus, erecting bird and insect boxes, planting biodiverse seeds, and removing invasive plants from the river island.\n\n==History== \nFounded on the 7th June 2020 this tiny micronation was founded by HRH Crown Prince John of The Isle of Lithua. \n\nIn September 2021 the Isle of Lithua had its first state visit and welcomed photographer Alex Stewart to her shores. \n\n==Legitimizing claims==\nLegitimacy is based on a local legend:\n\nDuring the childhoods of John, Prince of Lithua and his sister Princess Clare of Lithua growing up in the small rural Welsh village, the island in the centre of the village between the two rivers was said to belong to 9 different people in its entirety at the same time. During the start of the w:Covid-19|Covid-19 pandemic in 2020, the two siblings decided to explore this further by contacting the relevant authorities. According to w:Land Registry|Land Registry there was no record of the landmass ever being owned by anyone and as such, the siblings laid out a formal claim of ownership and after several days of heavy drinking, proclaimed it as a micronation free of any government authority, crowning their father in the process.\n{{Gallery"],
