    "motto": "{{short description|Micronation in Bangladesh}}\n{{Infobox country",
    "contactInfo": ["{{short description|Micronation in Bangladesh}}\n{{Infobox country"],
    "websites": ["https://micronations.wiki/wiki/Imruland", "https://imruland.website2.me/\n}}\n\nImruland, officially the Kingdom of Imruland, previously known as The Republic Kingdom of Imruland and the Republic of Imruland, is a micronation established in Bangladesh. It was created on 16 July 2022 by current Governor of Imruland|Governor Showib Ahmmed to pay tribute to the Bangladeshi cricketer Imrul I|Imrul Kayes who is currently serving as the King of Imruland|King of the country. Imruland is an observer state of the Grand Unified Micronational (GUM) since 21 March 2024.\n\nImruland declared their independence on 16 July 2022 and got independence two days later by a cold war. The Parliament of Imruland|Parliament was established on the day of declaration of independence. The country declared a formal republic on September 2022. Imruland transformed from dictatorship to constitutional monarchy on 23 December 2022 and changed its name from the Republic of Imruland to the Republic Kingdom of Imruland. The Republic Kingdom was succeeded by the Kingdom of Imruland on 16 July 2023 by taking the 3rd amendment of the Constitution of Imruland.\n\n==History==\n{{main|Republic of Imruland|Republic Kingdom of Imruland}}\nImruland declared their independence on 16 July 2022. A small cold war was occured after the declaration. The country got independence on 18 July 2022. Imrul I|Imrul Kayes was appointed as the President of Imruland|President of the country. The formal republic of the country was installed on 30 September 2022. The country transformed from dictatorship to constitutional monarchy on 23 December 2022. President of Imruland|President Imrul I|Imrul Kayes proclaimed himself as King of Imruland|King of the country as Imrul I. Crown Prince Shohayb|Shohayb, the only son of Imrul I, was declared as the King of Imruland#Crown Prince|Crown Prince.\n\nImruland faced political crisis for two times. The 2022 Imruland political crisis|first political crisis was began on 13 November 2022 when the then Deputy Prime Minister of Imruland|Deputy Prime Minister Shams Al Hasan|Shams Chomsky Rafi resigned from his post on a televised speech. He made a political party named Imruland National Party (INP). The party was banned by the government and was declared a rebel group. A state of emergency was also declared. The ban was lifted after an agreement between the government and the party. The chairman of the party Shams Chomsky Rafi was appointed as the Imruland National Party#Leader of The Opposition|Leader of The Opposition. He was banned from the Parliament of Imruland|parliament and exiled after two days of the appointment for the allegation of secret conspiracy against the government.\n\nThe 2023 Imruland political crisis|second crisis was happened on June-July 2023 after publication of the result of the 2023 Imruland President Election. The losing candidate Nazmul Hasan Fahim boycotted the result alleging massive rigging in the election. The supporters of Fahim led by former President of Imruland|President Fokhrul Sazzad attacked the parliament house. A state of emergency was declared for an indefinite period and all the supporters of Fahim and Sazzad were banned from Parliament of Imruland|parliament. The Constitution of Imruland was amended during the emergency period and the direct election system was cancelled. The positions of President of Imruland|president and President of Imruland#Vice President|vice president were abolished and a new type of government headed by Prime Minister of Imruland|prime minister was introduced. The name was changed to the \"Kingdom of Imruland\" with the abolition of presidency.\n\n==Government and politics==\nImruland is a constitutional monarchy and parliamentary system|parliamentary democracy, with the constitution providing a Parliament of Imruland|national assembly to serve as the legislative branch of government. The King of Imruland|King serves as the constitutional head of state|head of the country. The Governor of Imruland|Governor is the representative of the King. Mainly the Governor is the de facto constitutional head of state of Imruland as the King does not attend in any ceremonial function of the country. The government is headed by the Prime Minister of Imruland|prime minister who has been elected for a term of 145 days. He is elected by the votes of 9-20 members selected from the Parliament of Imruland|parliament by the Constitution of Imruland#Constitution Drafting Committee|Constitution Drafting Committee. No political activities is allowed in Imruland to maintain stability.\nImruland was scored 99 out of 100 on the annual report of the 2024 Micronational Freedom Index. The report mentioned Imruland as a \"stable democratic micronation respecting the most civil liberties\".<ref>{{Cite web |title= Kingdom of Imruland Report 2024 |url= https://microfreedomindex.wordpress.com/2024/05/05/republic-kingdom-of-imruland-report-2024/ |access-date= 6 May 2024 |date= 5 May 2024 |website=Micronational Freedom Index}}</ref>\n\n==Military and Security==\nImruland has a well equipped Imruland Armed Force|armed force consists of Imruland Army, Imruland Navy and Imruland Air Forces. The armed force played a vital role in the independence war of the country. The King of Imruland|King serves as the Supreme Commander of the armed force and the Governor of Imruland|Governor serves as the Deputy Supreme Commander as well as the de facto Supreme Commander. The motto of the armed force is \"We are all Imrul Army, dont fear bullet bombs.\" The government has a Defense Ministry to control the armed force. Imruland has a full-formed police force named Imruland Police and has a detective branch named Imruland Detective Branch (IDB). The country has a secret service headed by the Governor named Imruland Intelligence Agency (IIA).\n\n==Culture==\nThe culture of Imruland is mainly based on mathematical equation. The people enjoy their free time by matching equation of 45. The government has an organization named Bro Manei Somikoron (Bro Means Equation) to spread the equation. The jersey number of King of Imruland|King Imrul I is 45. So the people pay tribute to their King by finding 45 in everything. The country has a state-owned television channel named Imruland Television (ITV) and a state-owned newspaper named Imruland Pratidin.\n\n==Holidays==\nThe following is a list of holidays of Imruland:<ref>{{Cite web |title= List of public holidays of Imruland|url=https://drive.google.com/file/d/130EXpqb-WDTNd75creI43lT7P7TNtIeJ/view |access-date= 6 May 2024 |website=Google Drive}}</ref>\n\n{| class=\"wikitable sortable\" style=text-align:center;"],
    "name": "Kingdom of Imruland",
    "flag": "https://micronations.wiki//images/en/images/images/0/0c/Flag_of_Imruland.svg",
    "languages": ["Bengali"],
    "foundation": "16 July 2022"
