    "capital": "{{Inactive}}\n\nLumlin, officially the Principality of Lumlin, is a small 16.86 acre noncontiguous micronation with lands within New Jersey, Pennsylvania, New York, and Virginia in the United States. It is ruled by Prince Richard IV de Dunbar, it was created on 8 August 2008. \n\n\n== History ==\n\nThe land that is now part of Lumlin has been ruled by at least four countries, England, the United States, the Seynstano Kingdom, and now the Principality of Lumlin. (quite impressive for 0.13 acres) The Royal Family, de Dunbar has ruled the land since New Years Eve 1990. Prince Robert II and his wife purchased the land for their palace, castle to be built on, so it in turn became part of the Seynstano Kingdom, which Roberts mother ruled. It became known as the province of Potters Hollow.\n\nUntil 2003 the land remained part of the Seynstano Kingdom, when Prince Robert II left Potters Hollow leaving his now ex wife and three children. From 2003-2008, although unofficial, the land became part of the United States.\n\nThen on August 8, 2008 (8-8-08) son of Prince Robert II, Prince Richard IV created the Principality of Lumlin. Since then there has been a prototype constitution adopted and several provinces have been created, also new land has been annexed, the largest being the Annexation of Kawameeh, a 14 acre uninhabited park/swamp, but as of August 16, 2008 the annexation has been vetoed by the Prince. The Provinces of Colonia, Laguna, Kilgore-Thrum, and several others have been created since the creation of the principality.\n\nOn August 16, 2008, Prince Richards powers were broadened to the point where he makes every descision for the nation. The prince has since kept the country neutral, not participating in any micronation organizations.\n\nOn August 22, 2008 Lumlin officially annexed the Seynstano Kingdom after Queen Loretta stepped down from power, this added approxamately 6 acres of land to the Principality of Lumlin. The provinces of Mormaer, Seynstano, and Rickabaugh were added.\n\nThe Prince has a solid agreement with all family members that their property in the United States can and will become part of the country of Lumlin. As a result new provinces are continually being added and eventually some will be consolidated.\n\n== Provinces ==\n\n{| class=\"wikitable\"",
