    "flag": "https://micronations.wiki/wiki/{{Inactive}}\n\n'''Lumlin''',%20officially%20the%20'''Principality%20of%20Lumli'''n,%20is%20a%20small%2016.86%20acre%20noncontiguous%20[[micronation]]%20with%20lands%20within%20[[New%20Jersey]],%20[[Pennsylvania]],%20[[New%20York]],%20and%20[[Virginia]]%20in%20the%20[[United%20States]].%20It%20is%20ruled%20by%20Prince%20Richard%20IV%20de%20Dunbar,%20it%20was%20created%20on%208%20August%202008.%20\n\n\n==%20History%20==\n\nThe%20land%20that%20is%20now%20part%20of%20Lumlin%20has%20been%20ruled%20by%20at%20least%20four%20countries,%20[[England]],%20the%20[[United%20States]],%20the%20[[Seynstano%20Kingdom]],%20and%20now%20the%20Principality%20of%20[[Lumlin]].%20(quite%20impressive%20for%200.13%20acres)%20The%20Royal%20Family,%20de%20Dunbar%20has%20ruled%20the%20land%20since%20New%20Year's%20Eve%201990.%20Prince%20Robert%20II%20and%20his%20wife%20purchased%20the%20land%20for%20their%20palace,%20castle%20to%20be%20built%20on,%20so%20it%20in%20turn%20became%20part%20of%20the%20Seynstano%20Kingdom,%20which%20Robert's%20mother%20ruled.%20It%20became%20known%20as%20the%20province%20of%20Potter's%20Hollow.\n\nUntil%20[[2003]]%20the%20land%20remained%20part%20of%20the%20[[Seynstano%20Kingdom]],%20when%20[[Prince%20Robert%20II]]%20left%20Potter's%20Hollow%20leaving%20his%20now%20ex%20wife%20and%20three%20children.%20From%202003-2008,%20although%20unofficial,%20the%20land%20became%20part%20of%20the%20United%20States.\n\nThen%20on%20August%208,%202008%20(8-8-08)%20son%20of%20Prince%20Robert%20II,%20[[Prince%20Richard%20IV]]%20created%20the%20Principality%20of%20[[Lumlin]].%20Since%20then%20there%20has%20been%20a%20prototype%20constitution%20adopted%20and%20several%20provinces%20have%20been%20created,%20also%20new%20land%20has%20been%20annexed,%20the%20largest%20being%20the%20Annexation%20of%20Kawameeh,%20a%2014%20acre%20uninhabited%20park/swamp,%20but%20as%20of%20August%2016,%202008%20the%20annexation%20has%20been%20vetoed%20by%20the%20Prince.%20The%20Provinces%20of%20Colonia,%20Laguna,%20Kilgore-Thrum,%20and%20several%20others%20have%20been%20created%20since%20the%20creation%20of%20the%20principality.\n\nOn%20August%2016,%202008,%20Prince%20Richard's%20powers%20were%20broadened%20to%20the%20point%20where%20he%20makes%20every%20descision%20for%20the%20nation.%20The%20prince%20has%20since%20kept%20the%20country%20neutral,%20not%20participating%20in%20any%20[[micronation]]%20organizations.\n\nOn%20August%2022,%202008%20Lumlin%20officially%20annexed%20the%20Seynstano%20Kingdom%20after%20Queen%20Loretta%20stepped%20down%20from%20power,%20this%20added%20approxamately%206%20acres%20of%20land%20to%20the%20Principality%20of%20Lumlin.%20The%20provinces%20of%20Mormaer,%20Seynstano,%20and%20Rickabaugh%20were%20added.\n\nThe%20Prince%20has%20a%20solid%20agreement%20with%20all%20family%20members%20that%20their%20property%20in%20the%20United%20States%20can%20and%20will%20become%20part%20of%20the%20country%20of%20Lumlin.%20As%20a%20result%20new%20provinces%20are%20continually%20being%20added%20and%20eventually%20some%20will%20be%20consolidated.\n\n==%20Provinces%20==\n\n{|%20class=\"wikitable\"",
