    "motto": "   As the wheel turns.",
    "contactInfo": ["Forum===\nPrior to the approval of the Forum, Leo had seen relatively little legislation passed in the past month, with only two acts, the High Council Act 2021 and the Forum Act 2021. Notably, however, both of these acts were significant.\n\nOn 22 January 2021, a set of landmark acts were passed reorganizing the legislature of Leo into a bicameral legislature. The Forum Act 2021 created the Forum of the Republic of Leo, a liquid democratic semi-bicameral legislature with semi-legislative power. This organized the Senate of the Republic of Leo as the higher chamber of the legislature, and the High Council as the lower chamber. Along with the High Council Act 2021, the High Council became a semi-legislative body with power to pass resolutions and admit new administrative divisions to the Republic. With the immediate passing of the Forum Act, all national matters devolved to the Forum for approval. The High Council has the right to pass resolutions, which required the confidence of the Premier Major to go into effect. Without the confidence of the Premier Major, the resolution may be sent to the Senate, where it may be proposed as a new Act.\n\nThe Forum consists of every citizen of Leo, an every citizen has a right to vote in the Forum. Citizens also have the right to delegate their vote to someone else. This is a system known as liquid democracy, and enables citizens to change their delegation at any time. Under the new system, the Senate retained its job and continued to be the main legislative organ of the nation, despite the High Councils new power to pass legislation.\n\nUltimately, the Forum failed to stimulate interest in the Leosian government, and the government did not have an adequate number of citizens to continue running in its former capacity; efforts to downsize the government did not realize, despite some discussion. As a result, there was growing discontent with Taus rule, and many thought he had been in office too long.\n\n=== Recent history ===\nGrowing upset with the state of the government, and the general lack of government, calls for Tau to resign ramped up. Tau didnt formally acknowledge these calls until 6 February 2021, when Tau announced his intent to resign. A new campaign for Premier Major begun, which notably lacked Moustapha Hoteit, the consensus frontrunner. The only declared candidate was May Cambridge; however, Tau returned to write an opinion piece that led to Cambridge ending her campaign. Hoteit occupied the premiership for about a month until 15 March 2021, when Unix Farnsworth was elected.\n\n==Eras of Leo==\n\n===Official Government Recognised Eras===\n{| class=\"wikitable\"\n! colspan=\"3\" |Era\n!Full Country Name\n!Name of Era\n!Length of Era\n!Notes"],
