    "foundation": "{{poor}}\n[[File:Red Cola.jpeg|thumb|Right|Red Cola Sponsor of the FIIFA Micronational Ranking.]]\nThe '''Micronational World Ranking''' (oficially named FIIFA/Red-Cola Micronational World Ranking) is a ranking system for [[FIIFA]] Members for Men´s football, since 1999.\n\nThis System is based on the results of the matches between the national teams. the system only counts the results from the [[Micronations World Cup]] and the [[Copa América de Micronaciones]] to the Micronations of America and for Europe the [[Micronations World Cup]], and the friendly matches. The system is composed only with a simple mathematic equation.\n\n*P= Total Points (Victory= 3pts, Draw= 1pt, Lose=1)\n*MS= Match Status (Friendlies= x1.0 || WC Qualifiers or Continental Cup Qualifiers= x2.5 || Continental Cup= x3.0 || WC Finals= x4.0)\n*OS= Opponent Strength (50 minus Number of the rank possition divided by 2)\n*RS= Regional Strength (America= 1.00 || Europe= 0.99 || Rest of Confederations= 0.85\nThe equation will be P=(P)(MS)(OS)(RS)\n\n\nOf the 38 FIIFA member micronations, only 27 have been ranked, which are the same ones that have had any participation in official competitions\n\n{| class=\"wikitable\" style=\"font-size: 100%; float: right; margin-right: 1em;\""
