    "capital": "{| class=\"wikitable\" style=\"float: right; width: 300px; margin: 0 0 1em 1em; border-collapse: collapse; font-size: 95%;\" cellpadding=\"4\" border=\"1\"\n|+ style=\"font-size: 160%; margin-left: inherit;\" |Dershowo Musograd\n| colspan=\"2\" align=\"center\" |File:Flag_dershowo_musograd_200.jpg<br />National Flag\n|-\n| colspan=\"2\" align=\"center\" |<small>Motto: We No Longer Want You Pushing Us<br />Official National Anthem: Musograd Jedna Patrija<nowiki/><br />Inofficial Anthem: All We Are by Doro</small>\n|-\n|Type of entity:\n|Micronation\n|-\n|Location:\n|Western and central parts of the Musanian Lands; physical residence in Berlin and near Stuttgart, Germany\n|-\n|Leadership:\n|Adm. Sergej Dimitrijevich Xander, High Commander of the Dershowo\n|-\n|Organisational structure:\n|Parliamentary Republic\n|-\n|Language:\n|Musogradian and English\n|-\n|Purported currency:\n|Common Wallaroo\n|}\nThe Dershowo Musograd (Dershowo = State) is a quite old micronation and a founding member of the Federated Micronations of the Musanian Lands (FM). Musograd declared independence from Germany on the day of Germanys reunion, 1990-10-03 (October 3, 1990). It has got an advanced industry, both hardware and software. The first software company in Musograd was founded in 1986, http://www.posta.musograd.org/ Posta tal Musograd issued their first stamps in 1985, and the national home page, http://www.musograd.org www.musograd.org, was launched in 2005. Musograd has started late to develop relations with other micronations. Today, foreign relations are generally managed by its sister nation in the Federated Micronations, the Republic of Capricornia.\n\nThe major ethnic group of Musograd is of Western Slavic descent (the westernmost slavic settlement group in Europe) and speaks the Musogradian or Musoka language. Cyrillic letters are currently used together with Latin ones. In the Free Port of Kosnice, English is the main language, and in some parts of eastern Musograd settled by Balanda, German is used.\n\n==Government==\n\nThe Dershowo Musograd is a parliamentarian republic, headed by the High Commander of the Dershowo (a presidential role being regularly renamed). It consists of the 5 oblasts (counties) of Musograd (the",
