    "capital": "{{Inactive}}\n{{cleanup}}\n{{out of date}}\n{| class=\"wikitable\" border=\"1\" cellpadding=\"4\" style=\"float: right; width: 300px; margin: 0 0 1em 1em; border-collapse: collapse; font-size: 95%;\"\n|+ style=\"font-size: 160%; margin-left: inherit;\" | Principality of New Utopia\n|-\n| align=\"center\" | File:Newutopia-flag-s.png‎|125px|Flag\n<br />Flag\n| align=\"center\" | File:Coa-newutopia.jpg‎|100px|Seal\n<br />Seal\n|-\n| colspan=\"2\" align=\"center\" | <small>Motto: tba<br />(English: tba) <br />Musical Anthem: tba</small>\n|-\n| Type of entity:\n| Micronation\n|-\n| Location:\n| Misteriosa Bank, w:Caribbean Sea|Caribbean Sea\n|-\n| Area claimed:\n| 3,000 acres/1,214 hectares (deeds issued) \n|-\n| Membership:\n| > 3,800\n|-\n| Date of foundation:\n| 20 July 1999 \n|-\n| Leadership:\n| Prince Lazarus I (Lazarus Long)\n|-\n| Purported organisational structure:\n| Constitutional monarchy\n|-\n| Language:\n| English\n|-\n| Purported currency:\n| New Utopia Crown\n|-\n|}\n\nThe Principality of New Utopia was a libertarian micronation founded in the mid 1990s by w:Oklahoma|Oklahoma resident Lazarus Long, his family and business associates. It is generally dismissed by those who see Longs claims as overstated and unattainable. It is conceptually similar to several unrelated attempts at establishing sovereign libertarian city-states on man-made islands extending as far back as the 1960s, including such efforts as the Atlantis Project the Republic of Minerva as well as The Palm & World projects in Dubai.\n\n\n==History==\nThe driving force behind New Utopia is Mr. Lazarus Long. (Prince Lazarus) He has been an entrepreneur all his life. Hes now 73, \"going on 43.\" Before he legally had his name changed, he was known as Howard Turney. As Howard Turney, (the Prince) is the former Chairman of the Board of Mayday USA, Inc., he was the Founder and Chairman of El Dorado Clinics, Was the founder and Chairman of Cryogenics Solutions Inc., former President and CEO of Cogeneration Systems International, and former Chairman, CEO of Power Resources Systems. Mr. Long was the Founder and is Chairman of The Rejuvenation and Longevity Foundation a non-profit Corporation. He is a member of MENSA, World Mariculture Society, and the International Cogeneration Society. He has received many honors and is listed in Whos Who in American Business Leaders, The International Directory of Distinguished Leaders, Who’s Who in Finance and Industry, Who’s Who in The Southwest, and The Cambridge Directory of Who’s Who, 1997 edition. The companies he has founded include food manufacturing (3), restaurants, mariculture, personal security, medical clinics, and a medical service company. (There will be a medical center specializing in anti-aging medicine on New Utopia.) He has been involved with the medical field for the last several years in the anti-aging area of medicine, and as Howard Turney had received a great deal of television exposure and travelled world-wide, appearing on television and radio shows as a spokesperson in the anti-aging field of medicine… so much so, in fact, that his name regularly appears in books and educational television documentaries on the subject. He became known within the field as “The Father of Human Growth Hormone,” due to his having pioneered and promoted its use in anti-aging medicine.\n\nWhen he shifted his career path to pioneering a new country; one with a stable, free-market economy, Mr. Turney realized his name recognition in the anti-aging medicine field could be a detriment to the founding citizen’s goals in establishing the new country. He felt that it was imperative that New Utopia not be perceived as simply another offshore medical facility, but primarily as a banking and insurance center, as well as a Caribbean playground and rejuvenation clinic.\n\nThis is the reason he chose to change his name. He chose the name of Robert Heinleins fictional character because as he was portrayed, he held similar philosophies to Mr. Turney. Of course, all of this will become common knowledge, but as he says, “It seemed like a good idea at the time, and I do not regret having taken this step, a new career path, a new name. It seems fitting.”\n\nNew Utopia is conceived by Long as an artificial island nation in the Caribbean Sea, where the use of the latest technologies and unfettered free enterprise",
