    "capital": "Capital city}}\n\nEarldom of Nortiforss is an administrative unit - fief of Princedom of Aysellant. Located in the northwest of the Princedom and consists of Nortiforss, Wasermerkit, Kronenhaut bailliages and baronies . Administrative center - Nortiforss. The largest towns - Wasermerkit and Kronenhaut. In Nortiforss are Earls Museum, the Castles Picture Gallery, The Monastery. There are stations with points of border and customs control .. In the vicinity of the city are the communication station. Also, the Air Force Squadron stationed here .\nCategory:Administrative divisions\nCategory:Government\nCategory:Aysellant\nCategory:Micronations\nCategory:Monarchies \nCategory:Micronations established in 2011\nCategory:Russian-speaking regions\nCategory:Antarctic micronations\n\n{| class=\"vcard horizontal-navbox\" style=\"text-align:center; font-size:100%; background:#FFFFFF; border:1px solid #AAA; color:black; clear:center; float:center; margin:0.5em 0 0.5em 1em; padding:0.2em;width:100%\"",
