    "capital": "{{Orphan|date=July 2024}}\n\n== History ==\non June 3, 2023, the short lived Simulia had fallen. this left a 1 and a half gap of unclaimed territory. on the 2nd of August, the\n\nHoly Principality of North Macedonia was founded, as a faith based micro-nation.\n\n== Etymology ==\nNamed after North Macedonia\n\ncover, Ostwania is named this because it is thought of as a haven from the harshness of the city, a place under Gods protection\n\n== Military ==\nThe Royal North Macedonian Armed forces consist of land army divided into three divisions. you are put into divots based on skill level. each Ostwanian has to complete 2 month of service before \"dechmil ashral\" or Decision day, where the chose weather or not the want to leave or stay in the military. infantry ranking goes from 3–1, with 3 the lowest and 1 the highest.\n\nthey were part of the FAMC-UCM Conflict\n{| class=\"wikitable\"",
    "currency": "{{Orphan|date=July 2024}}\n\n== History ==\non June 3, 2023, the short lived Simulia had fallen. this left a 1 and a half gap of unclaimed territory. on the 2nd of August, the\n\nHoly Principality of North Macedonia was founded, as a faith based micro-nation.\n\n== Etymology ==\nNamed after North Macedonia\n\ncover, Ostwania is named this because it is thought of as a haven from the harshness of the city, a place under Gods protection\n\n== Military ==\nThe Royal North Macedonian Armed forces consist of land army divided into three divisions. you are put into divots based on skill level. each Ostwanian has to complete 2 month of service before \"dechmil ashral\" or Decision day, where the chose weather or not the want to leave or stay in the military. infantry ranking goes from 3–1, with 3 the lowest and 1 the highest.\n\nthey were part of the FAMC-UCM Conflict\n{| class=\"wikitable\"\n|+Infintry Divions\n!logo\n!name \n!size/ personnel\n!rank\n|-\n|File:Basic infantry 22.jpg|99px\n|Basic Infantry\n|4\n|Three\n|-\n|File:Greater infantry logo.jpg|99px\n|Greater Infantry\n|3\n|Two\n|-\n|File:Royal Guard .jpg|99px\n|Supreme Guard\n|3\n|One\n|}\n===Recognized micronations/nations===\n*{{flag|United Nations}}\n*{{flag|Taiwan}}\n*{{flag|Sahrawi Arab Democratic Republic}}\n*{{flag|South Ossetia}}\n*{{flag|Palestine}}\n*{{flag|Somaliland}}\n*File:Lizlo Flag.png|25px Lizlo Republic \n*File:EOA Flag 2.jpg|25px Empire of Aeternia\n*File:Flag of Slowjamastan.png|25px Slowjamastan\n*File:Vanersiaflag.png|25px State of Vanersia\n* File:Beag flag 2.jpg|frameless|25x25pxRepublic of Beag\n\n== Government==\n\nThe government of New Macedonia is a unique blend of Christian theocracy and monarchy. At the helm of this nation is a hereditary monarch, whose authority is seen as divinely ordained, making the monarchy a pivotal institution in both political and spiritual matters. The governance of New Macedonia is deeply intertwined with Christianity, with the Church holding significant influence over state affairs. Theocratic principles guide legislative decisions, and religious leaders play a prominent role in shaping policy and moral standards. This distinctive fusion of religion and monarchy has fostered a society where faith and governance are tightly interwoven, shaping the nations laws, customs, and values. While the governments structure may differ significantly from more secular systems, it underscores the importance of faith in the daily lives of Ostwanians, emphasizing the nations strong commitment to its Christian heritage.\n\n==Climate==\nNew Macedonia Climate is much like the Southeastern US, it has all Four seasons and natural disasters \n{{Weather box\n|location = Kahpis, New Macedonia|metric first = yes\n|single line = yes\n|Jan high F = 45.5\n|Feb high F = 54.4\n|Mar high F = 59.7\n|Apr high F = 69.4\n|May high F = 78.6\n|Jun high F = 97.7\n|Jul high F = 98.2\n|Aug high F = 88.5\n|Sep high F = 83.1\n|Oct high F = 67.1\n|Nov high F = 59.9\n|Dec high F = 49.9\n|year record high F = 99.9\n|source = Weather US\n}}\n\n==",
