    "motto": "{{Confuse|Holy Byzantinum Empire}}\n{{Infobox country",
    "contactInfo": ["forum for Byzantium Novum. This ministry is for discussion and study of Byzantine military history and reenacting. The current Grand Master of the Camp is Manuel Tagaris.\n*<u>Foreign Ministry</u>: The Foreign Ministry, under the supervision of the Foreign Minister, is responsible for two main functions: establishing foreign relations with other nations (including microstates) and similar entities and encouraging the study of historical neighbours of the Byzantine Empire. The current Foreign Minister is Senator Origen Iuventius Kamberis Chlodooualdos.\n*<u>Chancellery</u>: The Grand Chancellor is the senior administrative official within the Imperium Institutionum (αυτοκρατορική υπηρεσίες), and pursuant thereto coordinates all imperial ministries. The Grand Chancellor also serves as the Clerk of the Senate. The current Grand Chancellor is Senator Julius Hugonis.\n*<u>Orthodox Church</u>: The Church of Byzantium Novum, under the Grand Prelate of the Church of Byzantium Novum, is responsible for all Christian religious study and observances within the Empire. The current Grand Prelate is Gaius Lucretius Agrippa.\n*<u>Classical Church</u>: The Classical Church of Byzantium Novum, under the Pontifex Maximus, is responsible for all Byzantine Pagan religious study and observances within the Empire. The current Pontifex Maximus is Senator Origen Iuventius Kamberis Chlodooualdos.\n*<u>Chamberlaincy</u>: The Chamberlaincy, under the Grand Chamberlain of the Empire, is the main forum for Byzantine cultural topics in Byzantium Novum, including all the arts and sciences of the era. The Chamberlaincy’s purview includes Byzantine arts, science, music, costuming, writing, literature, architecture, philosophy, etc. The Chamberlaincy is presently vacant.\n*<u>Treasury</u>: The Treasury, under the supervision of the Grand Treasurer of the Empire, is responsible for collecting the funds of the Empire and ensuring they are safeguarded, spent in accordance with Senate guidelines, and audited at least once annually and will be responsible for establishing financial guidelines to effect the smooth functioning of the regional and local groups of the Empire. The current Grand Treasurer is Senator Marcus Cassius Julianus.\n*<u>Chartulary</u>: The Chartulary, under the Grand Chartulary of the Empire, is responsible for recruiting and assisting new members in integrating themselves into the Empire and for establishing recruiting and new members’ integration guidelines to effect the smooth functioning of the regional and local groups of the Empire as well as media relations. When it is fully established, the Chartulary is responsible for Counts’ School and the New Groups Handbook. The Chartulary may appoint regional deputies called “Grand Ostiaries” when required. The current Grand Chartulary is Julianus Oribasius.\n\nAll Ministries are outlined in the Constitution of the Empire of Byzantium Novum as well as in the Administrative Handbook.\n\n==Foreign Relations==\nFile:Foreign Minister Coat of Arms.png|thumb|The arms of the Foreign Ministry\nThe Empire of Byzantium Novum only enters into formal relationships with a Mutual Recognition Treaty (MRT) with other nations after all of the official criteria for the relationship has been established. Additionally, the Empire may enter into relationships with a more informal Memorandum of Understanding (MOU) that addresses specific areas of a limited formal relationship between the nations.\n\nThe foreign relations for Byzantium Novum is conducted through the Foreign Ministry and is the responsibility of the Foreign Minister.  The roles of the Foreign Ministry are:\n\n#To establish and maintain foreign relations with foreign governments and organizations\n#To encourage the study of the historical neighbors and successor states of the Byzantine Empire\n\nThe Empire of Byzantium Novum is currently an Observing member of the League of Hellenistic Micronations and enjoys a particular closeness with the Karno-Ruthenian Empire as well.\n\n{| class=\"wikitable\""],
