    "currency": "Pinang, ufficialmente Repubblica Pinanghese è una micronazione  senza sbocco sul mare transcontinentale con territori in Europa, in Sud America, in Asia e Oceania.\nConfina con lw:Italy|Italia, w:United Kingdom|Regno Unito, w: Bielorussia|Bielorussia, w:Australia|Australia,w:Bangladesh|Bangladesh,w:Monaco|Monaco e w:Brazil|Brasile.  \nPinang ha attualmente una popolazione di 20 abitanti e dal 30 Gennaio 2022 è una repubblica parlamentare.\n\n\n{| class=\"infobox\" style=\"width: 20px; float:right; clear:right; font-size:88%\" cellspacing=\"2\"",
    "motto": "Pinang, ufficialmente Repubblica Pinanghese è una micronazione  senza sbocco sul mare transcontinentale con territori in Europa, in Sud America, in Asia e Oceania.\nConfina con lw:Italy|Italia, w:United Kingdom|Regno Unito, w: Bielorussia|Bielorussia, w:Australia|Australia,w:Bangladesh|Bangladesh,w:Monaco|Monaco e w:Brazil|Brasile.  \nPinang ha attualmente una popolazione di 20 abitanti e dal 30 Gennaio 2022 è una repubblica parlamentare.\n\n\n{| class=\"infobox\" style=\"width: 20px; float:right; clear:right; font-size:88%\" cellspacing=\"2\"",
    "contactInfo": ["forum di microwiki che verrà nominato Ministro dellInterno dal Primo Ministro Esty e entrerà nella politica della micronazione.\n\n==Arciducato==\n{{main|Arciducato di Pinang/it}}\nIl 15 Giugno viene formato l Arciducato di Pinang e il giorno dopo si svolgono le elezioni per l Arciduca.\nIl 19 Giugno l ex vice-presidente diventa ufficialmente Arciduca di Pinang.\nIl 6 Agosto 2018 vengono annessi due nuovi territori e la popolazione aumenta di 4 Abitanti.\nIl 31 Agosto 2019 il comune di Bazhong viene annesso all Italia.\nIl 7 Dicembre si svolge un referendum per entrare nella GUM in cui il 100% dei votanti vota a favore dell entrata.\nIl 30 Aprile 2018 Bazhong viene riannesso all Arciducato dopo otto mesi dallannessione alla Repubblica Italiana\n===Crisi Pre-Elettorale===\nIl 17 Ottobre 2019, le elezioni vengono rimandate per mancanza di candidati necessari.\nDue giorni dopo, Esty si dimette dalla Carica di Primo ministro e dall ufficio di Presidente del Parlamento.\nL ex premier presenta al parlamento una bozza di costituzione che viene approvata dal Parlamento.\n==Seconda Repubblica==\n{{main|Seconda Repubblica di Pinang/it}}\n===Primo Periodo===\nLa Seconda Repubblica di Pinang nasce il 21 ottobre 2019.\nLe elezioni presidenziali vengono state vinte dallex premier Esty e a novembre si svolgono le elezioni per il senato nazionale. \nIl 31 dicembre 2019, il Senato Nazionale approva una legge contro la corruzione e lintimidazione.\n\n===Secondo Periodo===\nIl 2 Febbraio 2020 viene introdotta una nuova costituzione che trasforma Pinang in una repubblica direttoriale guidata da un triumvirato. \nIl 22 febbraio 2020 viene formato il Partito Liberale Costituzionale  e cinque giorni dopo viene approvata una legge sulla cittadinanza.\nL8 Marzo 2020 il sindaco di Costituzione muore dinfarto e il triumvirato proclama lutto nazionale per quattro giorni.\nIl 22 Marzo 2020 la nazione addotta il calendario giuliano dopo un referendum.\nIl 30 aprile 2020 il triumvirato approva una nuova costituzione.\n==Commonwealth==\nIl 2 Maggio 2020 Pinang ritorna una monarchia e la nuova costituzione entra in vigore.\nIl 16 Maggio 2020 si svolgono le prime elezioni per il Rayiys e il 17 Maggio viene formata lAssemblea Nazionale di Pinang/it|Assemblea Nazionale e il primo consiglio esecutivo del Commonwealth.\n\n=Geografia=\n=Popolazione=\n\nPinang ha attualmente una popolazione di 14 Abitanti.\n\n{| class=\"wikitable\"\n!Data\n!Popolazione\n!Percentuale"],
