    "contactInfo": ["{{Infobox country\nNovian Republic\n|native_name = \n|image_flag = File:NALuneFlagBlank.png|150px\n|image_coat = File:NovaparanCrest.png|75px\n|other_symbol = \n|image_map = File: Map_of_Novapara_-_earth_color.png|250px<br> Map of Novapara\n|loctext = \n|map_caption = \n|motto = démarche artistique (French: artistic approach)\n|anthem = Media:Cello Suite No.3 - Prelude.mp3|Chello Suite No. 3 - Prelude (performed by Mischa Maisky)\nFort Fuca\n|largest_city = Fort Fuca\nOfficial: English Seconardy: Spanish\n|regional_languages = \n|religion = \n|demonym = Novaparan, Novaparisian, Novian\n|government_type = Republic\n|leader_title1 = \n|leader_title2 = Prince\n|leader_title3 = \n|leader_title4 = \n|leader_title5 = \n|leader_name1 = \n|leader_name2 = Mr. Xavier\n|leader_name3 = \n|leader_name4 = \n|leader_name5 = \n|legislature = Parliament\n|upper_house = \n|lower_house = \n|established = 22 January 2016\n|area = 0.4 sq miles\n|population_census = 7\n|population_census_year = (as of April 12th 2016)\nNovacoin, United States Dollar\n|GDP_nominal = \n|HDI = \n|time_zone = w:Pacific Time|Pacific Time\n|utc_offset = \n|ris002code = \n|cctld = \nhttp://novapara.netne.net/ Government website\n|footnotes = This nation is a project-state\n|p1      = \n|flag_p1 = \n|p2      = \n|flag_p2 = \n|p3      = \n|flag_p3 = \n|p4      = \n|flag_p4 = \n|p5      = \n|flag_p5 = \n|s1      = \n|flag_s1 = \n|s2      = \n|flag_s2 = \n|s3      = \n|flag_s3 = \n|s4      = \n|flag_s4 = \n|s5      = \n|flag_s5 = \n}}\nCategory:Pages using an automatically generated Infobox country\n\nThe Principality of Novapara is a micronation located in the Pacific Northwest. The island nation was founded on January 22, 2016, as a model-state project on Whidbey Island and is still in an active status. The American state, Washington, borders it on three sides while the Puget Sound (Salish Sea) on one. Novapara has an area of 0.4 sq miles (1.036&nbsp;km) and a terrestrial population of 5.\n\nNovapara is a principality, governed under a form of a constitutional monarchy, with Prince Xavier as head of state. The monarch still wields immense political power, especially under the State of Emergency. The official language is English although French is often used, prominently in government use. The states independence has not yet been recognized or declared. Currently, the nation functions under the dominance of the USA, thus the USA is responsible for the countrys protection. Novapara enjoys the use of American roads, power and many other utilities and pays an annual contribution in return.\n\nEconomic development in the nation has been slow and small. Due to little usable land, lack of resources and workforce there isnt much to develop. Most recent efforts to spur a better local economy has been in the development of local agriculture. An international private sector has been proposed as well, still in beta, however.\n\n==History==\nThe nation was founded as a model-state on January 22, 2016. While practising a solitude-based foreign policy its still a relatively active member in the micronation "],
