    "currency": "La Seconda Repubblica di Pinang, ufficialmente Repubblica Democratica di Pinang  è stata una micronazione  senza sbocco sul mare situata nellEuropa meridionale.\nLa Seconda Repubblica di Pinang venne formata il 21 Ottobre 2018 succedendo allArciducato di Pinang|Arciducato. La Seconda Repubblica è stata una Repubblica Presidenziale dal 21 Ottobre 2019 al 2 Febbraio 2020. Il 2 Febbraio 2020 la Repubblica diventò una repubblica direttoriale guidata dal Triumvirato di Pinang/it|Triumvirato. Il 2 Maggio 2020 Pinang ritornò una monarchia costituzionale.\n\n\n\n{| class=\"infobox\" style=\"width: 20px; float:right; clear:right; font-size:88%\" cellspacing=\"2\"",
