    "currency": "Minerva Dollar",
    "motto": "{{Wikipedia}}\n{{Infobox country",
    "contactInfo": ["{{Wikipedia}}\n{{Infobox country\nRepublic of Minerva\n|native_name = \n|image_flag = File:Flag of Minerva.svg|220px\n|image_coat = \n|other_symbol = \n|image_map = \n|loctext = \n|map_caption = \n|motto = Land of the Rising Atoll\n|anthem = \n\n|largest_city = \nEnglish\n|regional_languages = \n|religion = \n|demonym = \n|government_type = Republic\n|leader_title1 = \n|leader_title2 = President\n|leader_title3 = \n|leader_title4 = \n|leader_title5 = \n|leader_name1 = \n|leader_name2 = Morris C. Davis\n|leader_name3 = \n|leader_name4 = \n|leader_name5 = \n|legislature = \n|upper_house = \n|lower_house = \n|established = 19 January 1972\n|area = \n|population_census = 42\n|population_census_year = \nMinerva Dollar\n|GDP_nominal = \n|HDI = \n|time_zone = \n|utc_offset = \n|ris002code = \n|cctld = \n\n|footnotes = \n|p1      = \n|flag_p1 = \n|p2      = \n|flag_p2 = \n|p3      = \n|flag_p3 = \n|p4      = \n|flag_p4 = \n|p5      = \n|flag_p5 = \n|s1      = \n|flag_s1 = \n|s2      = \n|flag_s2 = \n|s3      = \n|flag_s3 = \n|s4      = \n|flag_s4 = \n|s5      = \n|flag_s5 = \n}}\nCategory:Pages using an automatically generated Infobox country\nThe Republic of Minerva was one of the few modern attempts at creating a sovereign micronation on the reclaimed land of an w:artificial island|artificial island in 1972. The architect was w:Las Vegas, Nevada|Las Vegas w:real estate|real estate w:millionaire|millionaire and political activist w:Michael Oliver (real estate)|Michael Oliver, who went on to other similar attempts in the following decade. Lithuanian-born Oliver formed a syndicate, the Ocean Life Research Foundation, which allegedly had some $100,000,000 for the project and had offices in w:New York|New York and w:London|London. They anticipated a w:Libertarianism|libertarian w:society|Society with \"no taxation, welfare, subsidies, or any form of w:economic interventionism|economic interventionism.\"  In addition to tourism and fishing, the economy of the new w:nation|nation would include w:light industry|light industry and other commerce. According to Glen Raphael, \"The chief reason that the Minerva project failed was that the libertarians who were involved did not want to fight for their territory.\"<ref>{{cite web|last=Raphael|first=Glen|title=A Non-Non-Libertarian FAQ: Responses to Mike Huben|url=http://www.impel.com/liblib/NNLFAQ.html#13|publisher=impel.com|accessdate=6 June 2011}}</ref> According to w:Reason (magazine)|Reason, Minerva has been \"more or less reclaimed by the sea\".<ref>{{cite journal|last=Mangu-Ward|first=Katherine|title=Artifact: Hope Floats|journal=Reason Magazine|year=2008|month=August/September|url=http://reason.com/archives/2008/08/01/artifact-hope-floats|accessdate=6 June 2011}}</ref>\nThe site chosen for the Republic was the w:Minerva Reefs|Minerva Reefs in the w:Pacific Ocean|Pacific Ocean.\n\n==History==\nImage:MinervaReef3.jpg|Landing on Minerva, years after the confrontation.|left|250px|thumb\nImage:MinervaReef2.jpg|More people walking on Minerva.|right | thumb\nIt is not known when the reefs were first discovered but had been marked on charts as \"Nicholsons Shoal\" since the late 1820s. w:Henry Mangles Denham|Capt H. M. Denham of the w:HMS Herald (1822)|HMS Herald surveyed the reefs in 1854 and renamed them after the Australian whaler Minerva which collided with South Minerva Reef on 9 September 1829.<ref>Ruhen, Olaf. Minerva Reef, Minerva Bookshop Limited, 1963, p. 7</ref>\n\nIn 1971, barges loaded with w:sand|sand arrived from w:Australia|Australia, bringing the reef level above the water and allowing construction of a small tower and flag. The Republic of Minerva issued a w:declaration of independence|declaration of independence on 19 January 1972, in letters to neighboring countries and even created their own currency. In February 1972, Morris C. Davis was elected as Provisional President of the Republic of Minerva.\n\nThe declaration of independence, however, was greeted with great suspicion by other countries in the area. A conference of the neighboring w:sovereign state|states (w:Australia|Australia, w:New Zealand|New Zealand, w:Tonga|Tonga, w:Fiji|Fiji, w:Nauru|Nauru, w:Samoa|Samoa, and territory of w:Cook Islands|Cook Islandss) met on 24 February 1972 at which w:Tonga|Tonga made a claim over the Minerva Reefs and the rest of the states recognized its claim.\n\nOn 15 June 1972, the following proclamation was published in a Tongan government w:gazette|gazette:\n{{quote|His Majesty King Taufaahau Tupou IV in Council DOES HEREBY PROCLAIM:\nWHEREAS the Reefs known as North Minerva Reef and South Minerva Reef have long served as fishing grounds for the Tongan people and have long been regarded as belonging to the Kingdom of Tonga has now created on these Reefs islands known as Teleki Tokelau and Teleki Tonga; AND WHEREAS it is expedient that we should now confirm the rights of the Kingdom of Tonga to these islands; THEREFORE we do hereby AFFIRM and PROCLAIM that the islands, rocks, reefs, foreshores and waters lying within a radius of twelve miles 19.31 km thereof are part of our Kingdom of Tonga.}}\nA Tongan expedition was sent to enforce the claim. Tongas claim was recognized by the w:Pacific Islands "],
