    "websites": ["https://micronations.wiki/wiki/Rittia", "https://the-micronation-of-rittia-ea84ca.webflow.io/ and https://sites.google.com/view/the-micronation-of-rittia/home \n}}\nCategory:Pages using an automatically generated Infobox country\nThe Democratic Republic of Rittia and formerly known as the Republic of Rittia until 22 February 2024. Commonly known as Rittia, is a self-proclaimed sovereign micronation located in Norway. Rittia is located in the w:Nord-Trondelag|Nord-Trondelag, and was founded by Leif Erikson on 22 February 2024. As of 23 March 2024, Rittia consisted of 12 citizens; three of those citizens resided within Rittian territories, with the rest being \"global\" citizens. Rittia features diverse terrain, rugged mountains and dense forests in its region. \n\nRittia (Rhi-Tee-Ah) is a Democratic Republic, with Leif Erikson acting as Rittias Leader. The President is advised by The Council, which acts as a cabinet and consisted of 6 people, who are heads of their departments and represent the wider community. The Council of Rittia serves as the bicameral legislature of Rittia and is divided into Parliament and elected by the citizens of Rittia.\n\nRittia consists of two main administrative divisions; as of 23 March 2024, Rittia consists of two states, those being the The State of Bard and the The State of Ossnoya.\nOfficial Websites: https://rittiangovernement.mystrikingly.com, https://sites.google.com/view/the-micronation-of-rittia/home, https://the-micronation-of-rittia-ea84ca.webflow.io/\n\n==History==\nRittia was founded as the Democratic Republic of Rittia on 22 February 2024 in the city of Akaledo, by Leif Erikson. \nOn 4 May, Hal Tykirsson founded the State Of Ossnoya. Ten days later, he was appointed as one of the Council members of Rittia. \n==Demographics==\n{{main|Rittia Census}}\nMost information regarding the demographics of Rittia was taken during the Rittian Census, a survey between 4 March and 24 May 2024 that asked Rittian citizens about their ethnicities, languages and religions.\n===Population===\n{{Historical populations"],
