    "flag": "https://micronations.wiki/wiki/==Etymology==\nThe%20United%20Socialist%20States%20of%20Cades%20is%20a%20massive,%20cultured%20nation,%20ruled%20by%20Gamaliel%20Rodriguez%20with%20a%20fair%20hand,%20and%20notable%20for%20its%20public%20floggings,%20complete%20lack%20of%20prisons,%20and%20keen%20interest%20in%20outer%20space.%20The%20compassionate,%20democratic%20population%20of%201.842%20Cadeditas%20enjoy%20a%20sensible%20mix%20of%20personal%20and%20economic%20freedoms,%20while%20the%20political%20process%20is%20open%20and%20the%20people's%20right%20to%20vote%20held%20sacrosanct.\n\nThe%20large,%20outspoken%20government%20juggles%20the%20competing%20demands%20of%20Defense,%20Industry,%20and%20Education.%20It%20meets%20to%20discuss%20matters%20of%20state%20in%20the%20capital%20city%20of%20District%20City.%20The%20average%20income%20tax%20rate%20is%2074.9%,%20and%20even%20higher%20for%20the%20wealthy.\n\n==History==\n(The%20Persico%20History%20goes%20back%20to%20the%20distant%20February%207,%202006,%20founded%20on%20NationStates,%20Persico%20is%20a%20Democratic%20Socialist%20Micronation,%20being%20the%20first%20Socialist%20Micronation%20in%20Mexico,%20in%20the%20virtual%20simulator%20NATIONSTATES,%20faces%20Persico,%20April%202%20a%20cruel%20war%20against%20the%20nation%20of%20Brasilistian%20and%20victorious%20socialist%20government%20and%20the%20May%206%20Gamaliel%20Rodriguez%20was%20elected%20as%20the%20President%20of%20Persico%20and%20so%20on%20May%206%20the%20national%20Flag%20day%20and%20the%20April%202%20the%20day%20is%20celebrated%20independence.\n\nPersico%20has%20been%20stablished%20in%202006,%20buth%20have%20other%20names%20around%20on%20our%20History,%20now%20our%20Official%20name%20is%20The%20United%20Socialist%20States%20of%20Cades.\n{|%20class=\"wikitable%20sortable%20FCK__ShowTableBorders\"",
