    "capital": "capital city of the Federation of Atlantis, the largest city and political and institutional center of the Federation. Located in central Italy in the region of Campania, the city was the center of many events of the Republic like the Atlantis Civil War. Poseidon is growing and today the city is also the headquarters of the Atlantis Space Agency.\n\n==History==\n===During the Atlantis Civil War===\nIn the early times Poseidon has been annected to the territory of the Republic of Atlantis and has becomed the Capital of the Republic. At the first time the Mayor of the city has been Sante Carbone, until the begin of the Civil War. The territory was also used for all kind of military exercitations. After the facts of the Atlantis Civil War|Civil War of Atlantis the territory was occupied by the Liberation Army leaded by Sante Carbone. The troops tooke control of the main building of the Capital and formed a new Republic.\nThe territory was all occupied by the AnarchoCommunist National Liberation Army until the 28 September 2010 and there are tractives between the Republic of Atlantis and the new Socialist Autonom Republic of Atlantis for the rule of territory.\n\n===Battle of Poseidon===\nOn the afternoon of September 18, Manuel De Felice and an armed group of rebels opened fire (with an airsoft gun) against an Atlantis soldier of the Army in neutral territory. Soon after, the Atlantis Army and Marine Commando counterattacked using airsoft guns as well. At the end of the battle the AnarchoCommunist National Liberation Army surrendered to the Atlantis Armed Forces.\n\nAlhough Manuel De Felice was the Chief of Staff and Vice President of the Autonom Republic, he confessed that the group did not act in name of their Republic. All the rebels involved in the battle were arrested by the Atlantis Armed Forces. De Felice was later released, and together with Virgili later wrote a treaty of surrender. This part of the battle still remains uncertain, as the rebels and in particular Carbone, claim that De Felice never signed a document of armistice.\n\n===Poseidon divided in two parts===\nFile:Mapgk3.png|thumb|leftThe 28 September 2010 the Republic of Atlantis considering unstable the situation of the north part of the capital, established an autonom government respect the rest of the governorate while not recognizing the north part as an autonom nation. Also, all link with north Poseidon was closed by the south part. Always hoping to end the conflict with the diplomacy, the diplomatic embargo last long. The 27 was created a new flag of South Poseidon.\n\nAlthough the fighting had ceased weeks ago, the war didnt end until October 26, 2010, when the Treaty of Empire City was signed.\n\n===Caprica today===\nCaprica from the end of the Atlantis Civil War until now is the center of the life of the Federation. Demographically the most populous is an active city with political, military and institutional life.\nToday Caprica is also the headquarters of the Atlantis Space Agency and of the IMTO Court of Justice.\n\n====Timeline of Mayors====\n\n{| border=1 cellpadding=4 cellspacing=0 class=\"wikitable\" width=\"700px\" style=\"align: left; margin: 0.5em 0 0 0; border-style: solid; border: 1px solid #7f7f7f; border-right-width: 2px; border-bottom-width: 2px; border-collapse: collapse; font-size: 95%;\"",
