    "capital": "capital city.\n\n===Antarctic===\nThe Orphanian Republic claimed the Balleny Islands and Sturge Island, although it was not recognized due to a later claim by another micronation.\n\n==The Military==\nThe main branch of the Orphanian Republics military were the Orphanian Imperial Marines|Imperial Marines.\n\n===1st Battalion===\nThis was the largest battalion. It consisted of several branches:\n\n#First Regiment. All infantry. These are the grunts. They are the ground troops used by the Orphanian Republic. It also consists of a sniper unit. Also known as Batallion 1-1.\n#Second Regiment. These are the Imperial Engineers. They deal with anything the marines need built or destroyed. Also known as Battalion 1-2.File:DEFCON_4.png|thumb\n\n===2nd Battalion===\nThis battalion was smaller but still equally powerful.\n\n#First Regiment. All infantry. Many of them are tacticians and design strategies, but they are still the grunts. Also known as Battalion 2-1.\n\n===Bases===\n\n*In the capital city is the Premier and generals homes. The Premiers home is referred to as the Premiers Stronghold.\n\n*In the second major city/base is known as The Far North by many of the troops of our fine military.\n\n==Awards, Medals, and Decorations==\n===Shogun Cross===\n\nThis award is awarded to members of the military of the Orphanian Republic or the militaries of allied nations. It is awarded to those who have bravely lead troops to victory in combat.\n\n*Abbreviation: SHO.\n*Recipients:\n\n#HIH Crown Prince Jonathan of Austenasia\n#Gen. Sir Ryan Dickinson, KCP of Austenasia\n#Lieutenant Sir Hayes, KOM of Austenasia\n\n===Victory Medal===\n\nThis medal is awarded to the soldiers of Orphanian and Allied militaries, who have claimed victory in a conflict that the Orphanian Republic was involved in. The name of the award can vary from conflict to conflict.\n\n*Abbreviation: VACW\n*Variants: Victory in the Austenasian Civil War\n*Recipients: All soldiers of the Loyalist Armies Durring the Austenasian Civil War.\n\n==Orphanian Government Agencies==\n\n*Orphanian Imperial Marines\n*Orphanian Navy\n*Orphanian Intelligence Agency\n*Orphanian Department of Research and Development\n\n==Intermicronational Affiliations==\nUnited Micronations (UMN)- An organization based on youtube.\n\nOrphanian Department of Research and Development|The League of Micronations for the Benefits of Technology (LMBT)\n\n\n==Holidays==\n{| class=\"wikitable\" style=\"width: 200px; height: 220px;\"",
