    "capital": "capital Batyr, was declared an autonomous territory and officially named the \"Viadalvian Republic of Hasanistan\", with Ino De Wacht being selected as its viceroy. The Viadalvian Republic of Hasanistan was later reformed into a Federal territory the Viadalvian Republic of Konraq following queries by the Hasani government over the inclusion of the word \"Hasanistan\" in its former name. On November 14, 2013, Ino De Wacht was overthrown by democratic revolutionaries following corruption, fraud and being a despot. The Hasani government officially remained neutral on the regime change and continued to hold a cordial relationship with Konraq. In 2014, Konraq seceded from Viadalvia as part of Operation 888\n===First Republic===\nKonraq declared independence form Viadalvia and the First Republic was proclaimed by Abdul Faisal, The regime was very hostile towards Hasanistan (despite Hasanistan never knew about the state) and other claimants of it, The primary source of law is the Islamic Sharia derived from the teachings of the Quran and the Sunnah (the traditions of the Prophet). On 17 February, In order to prevent that Konraq would be annexed by Hasanistan. Derskovia invaded the Republic\n\n===Derskovian Occupation===\nAfter the invasion, A treaty was signed between Derskovia and Konraq. Konraq will become autonomous but it must remove its sharia law, Faisal agreed and stayed president of the Republic of Derskovian Hasanistan The Republic was a founding member of the GMA and had its affairs with countries outside of Derskovia. Upon formation of Derskov-Viadalvia Derskovia became an integral part of Derskvoia and its autonomy was removed\n\n===Dachenia and Pavlov===\n===Re independence===\nKonraq was allowed to peacefully succeed and full diplomatic relations were established between the two states. No referendum was officially needed to take place as residents of Konraq were officially registered as residents of the autonomous Ardajan region rather than Konraq, leaving Konraq-Kazakhizia with no registered residents to hold a referendum with.\nIn addition to diplomatic relations, a pact of mutual defence was established between Hasanistan and the new Konraqi state. The pact was ensured to be solely defensive and in respect of Hasanistans neutrality policy. A rotating leadership of the pact was established in the act to oversee the defensive alliance, with the head of states of both states taking turns to manage it. The Konraqi head of state had been announced as the first General Secretary of the Pact.\nThe Konraqi government had already established the basics of the government structure after the act had passed.\n===Recent History===\nOn August 29, the Senate of Konraq, held an extraordinary meeting in order to make some, at first, largely cosmetic constitutional changes. The government reformed itself from a republic to a constuitional non hereditary  monarchy the title of Mayor President is abolished and the title of Khan was created. The reason why the constuitional reform is approved is due to Konraqs small size and to give Konraq more prestige. Also Konraq was also named after a Kazakh khan so it doesnt feel right to have Konraq as a republic\n===Bokyism===\nThe overthrow of the monarchy was started by regent Mohammad Boky who was appointed by Habdaminah to regin while the Kan was absent,  Bokyists derived their support primarily from the conservative and Muslim people and the fact that the Kan was absent in Konraq for many times . Most of the Bokyists deposed the queen were ulema and conservative citizens, the reaction was also intented on day of eid-al-fitr They included former Balal legislators, government officers, and armed forces members\n\nThe events began on May 23 when Habdaminah asked Boky to regisn as regent,  Boky responded in a letter that the Konraqi people arent listing to a western puppet king  initiated the overthrow by organizing approximately 22 of the 34 citizens proclaimed loyalty to Boky,\n\nAs these events were unfolding, the Monarchy of Konraq expressed concern for the safety and preventation of an armed coup\n\nOn the next day, the Boky addressed a crowd assembled in WhatsApp and read aloud a proclamation that formally deposed Kan Habdaminah, Habdaminah proclaimed a government in exile in the Netherlands \n==Government==\nThe Government of Konraq takes place in a framework of aconstuitional non hereditary  monarchy and of a nonpartisan system. The Kan (Khan) is the head of state, leads the foreign policy, and is the Commander-in-chief of the Defense Forces. Legislative power is vested in the Senate (Konraq)|Senate of Konraq, and the government has limited rights to amend or extend legislation. The Kan of Konraq has the power of veto over parliamentary decisions although it can be overrun by the parliament. The judiciary is independent of the executive and the legislature. The Judiciary consists of two systems, regular courts and administrative courts, headed by the Supreme Court and the Supreme Administrative Court, respectively. Administrative courts process cases where official decisions are contested. There is no \"Constitutional Court\" - the constitutionality of a law can be contested only as applied to an individual court case. Though Konraq has a primarily parliamentary system, the Kan has some notable powers. The foreign policy is led by the Kan, \"in co-operation\" with the Senate, and the same applies to matters concerning national security. The main executive power lies in the cabinet headed by the prime minister. Konraqians enjoy individual and political freedoms, and suffrage is universal at age 13\n===Law and Order===\nLaw enforcement in Konraq is the responsibility of the Civil Guard (Jurisprudence operates on a Retributive justice system, with crimes being tried by a Province Court, a City Court, or the National Court, depending on the severity of the offence.\n\n==Administrative divisions==\nKonraq is divided into three parishes . Each one is controlled by an alderman who is appointed by the Kan\n{|class=\"wikitable\"",
