    "motto": "|Coming soon",
    "contactInfo": ["{{Draft submission|t||ts=20230901194935|u=XXX HD|ns=3000|demo=}}<!--- Important, do not remove this line before article has been created. --->\n<!---Test\n\nHier kommt bald mehr.\n\nFile:Ukavgauge.jpg|thumb|alt=etwas ist schifgegangen |the uks Loding gauge\n\nDas Bild ist nur zu testzwecken hier.-->\n<!--{{flag|TF}}\n{{flag|GS}}\n{{flag|no}}\n\n{{Infobox country"],
    "websites": ["https://micronations.wiki/wiki/Draft:Antarctican Empire", "coming soon <!--{{url|http://example.com}}-->\n}} <!-- Do not add an empty line after between the infobox and the introductory paragraph.-->\n<!--Use this guide with common sense and read it thoroughly; your article should be based on this guide but should not be a carbon copy of it either. Source editing is greatly preferred over Visual Editing, as the latter tends to trash pages. Editing this guide in source will also help you familiarize yourself with wikitext and will allow you to see important technical functions that visual editor will omit.-->\n\n<!--\n* Anything surrounded by <nowiki><nowiki></nowiki></nowiki> will force the software to display plain text. Remove it wherever it appears in this guide.\n* Parts of this guide intended to be filled in with your own info will be encased in single curly brackets: <nowiki>{example}</nowiki>\n* Text surrounded by <nowiki><!--</nowiki> and <nowiki>--><!--</nowiki> is a comment. These will tell the software to not include the enclosed content on the page entirely, and are present to help you as youre editing the page in source. Remove it after you have completed filling in the infobox and adding categories.-->\n\n<!--For more help, consult the Microwiki:Help desk|Help desk or join the MicroWiki MicroWiki:Discord|Discord server.-->\n\n:Not to be confused with the Empire of Antarctica|Empire of Antarctica.\n\nThe Antarctican Empire,<!--more commonly known as Example, --> is a micronation in Antarctica  its locatet at the southern hemisphere, whitch cosists of of the Antarctican continent, South Georgia and the South Sandwich Islands, Heard Island and McDonald Islands, Macquarie Island, Prince Edward Islands, Crozet Islands, Kerguelen Islands, Saint Paul and Amsterdam Islands, Peter I Island, Antipodes Islands, Auckland Islands, Bounty Islands, Campbell Islands, Snares Islands / Tini Heke, Bouvet Island and The islands in between that are usualy considert antarctican. <!--... The first paragraph should contain relevant information about location, significant subdivisions, and a brief history.-->\nAntarctican Empire is a w:Unitary_state|Unitary w:Parliamentary_system|parliamentary w:Constitutional_monarchy|semi-constitutional w:Empire|Empire in whitch power is shared between the Empreor and an electet Parliament. Economiclaly the Antarctican Empire is largely Keynesian, similar to  the pre thatcherite uk, with many nationalised industrys.<!--The second paragraph should give a brief overview of the nations politics and governance.-->\naltough the planis to establish the nation deeper and dereper al the way to full recognition by the international comunity,the aim of the Antarctican Empires forin polici is to establish frendly relationshipswith other nations as well as eatablishing the Antarctican Empire as an powefull internaional player.\n<!--The third paragraph should give an overview of the nations relation to the broader micronational movement and the nations foreign policy.-->\n\n== Etymology ==\nThe name is prity self explanatory, hoewer ther is a reason its called ,the Antarctican empire and not the Empire of antarctica, its the Antarctican empire in the same way its the German empire and not the Empire of germany. The \"empire\" comes from the titel of its ruler, the w:Emperor|Emperor. For the Etymology of w:Antarctica#Etymology|Antarctica see the relatet page.\n<!--Insert information about the origins of the name of the micronation.-->\n\n== History ==\nNot much is known about the history. But the idea of establishing a micronation in antarctica has existet for a long time, in an investigation, evidence was found as early as 2013. However most of the early days were only a planing Phase.<!--Insert a decently detailed but not overly long history of the micronation.-->\n\n== Politics and government ==\n<!--Insert a brief description of your nations government, its parts, and their functions.--> \nas an w:Parliamentary_system|parliamentary w:Constitutional_monarchy|semi-constitutional w:Empire|Empire the powe in the Antarctican Empire is shared between the the Emperor and the Paliament. the Emperor and the Prime minister are suposed to be equal in power\n\n<!--===Early government===\nIf your nation had any previous systems of government, explain them here, otherwise, you do not need this section.\n-->\n\n===<!--{Head of state}--> Emperor===\n<!--Explain the powers and abilities of the head of state of your nation in this section. Title this section after the position, not including \"The.\"-->\nThe Emperor is the head of state of the Antarctican Empire. he can declare war (and make peace), represent the Empire abroad, conclude treaties and alliances, and accredit and receive ambassadors. he can asembel and dissolve Paliament. he gets automaticly apointet Commander-in-chief of the Army, Air forces and Special forces as well as Grand admiral. he also has to apoint generals in the army and admirals in the navy. the tite of Emperor regnant is heredetary apon the death of the previous ruling Emperor regnant the titel is past to the oldest child of the impirial family or an inherit preiviously picked by the ruling Emperor/ Empress regnant.\n\n===<!--{Head of government}-->Prime minister===\n<!--Explain the powers and abilities of your nations head of government. Title it after the head of government, such as anyone second in command to the head of state. Again, no need to include \"The.\"--> \nthe Prime ministe is the Head of government of the Antarctican Empire. he gets apointet by the ruling party of coalision of the Landtagand acts as the head of the Landtag. he can also represent the Empire abroad,\n\n===<!--{Legislature}-->Paliament===\n<!--If your nation has a legislative branch, explain its function and structure here, titling the section with the name of the legislative body.-->\nPaliament of the Legislature of the Antarctican Empire. its comprised of two chanbers the Landtag and the Landrat. Otherchabers like a senat, a house of lords or a Privy Council were considert but curently its dicidet to not use these chanbers. laws have to pass both chanbers to be singht into efect.\n\n====Landtag====\nthe Landtag is the first chamber of the Antarctican Empire its directly voted on by the citicens of the Antarctican Empire. the ruling party of coalision appoints the Prime minister.\n\n====Landrat====\nthe Landrat is the second chamber of the Antarctican Empire its comprized of the diffrent goverments from the provinves of the Antarctican Empire.\n\n\n<!--Use <nowiki>====Level 4 headings====</nowiki> for the upper and lower houses or chambers.-->\n\n=== Political parties ===\n<!--Explain the background or history of the political parties in the state, and any guidelines or regulations regarding them. For the table, you can add or remove as many columns for the number of seats as needed. It is advised that you sample the colors for the table from the party logo.-->\nso far there wherent any elections in the Antarctican Empire so there is not much konwn about Political parties in the Antarctican Empire. in the antisipation to the oncoming electoions partys can still be foundet and aply to be electable in country wide , provinsial or local elections. the fondation of political partys is not heavaly regulated however a political party in the Antarctican Empire has to upholt the democratic and impirial order to be legal.\n\n{| class=\"wikitable\"\n!colspan=\"2\" |Logo\n!colspan=\"2\" |Name\n!Party Leader\n!Spectrum\n!Ideologies\n!Lower House\n!Upper House\n!Cabinet"],
