    "currency": "{{Defunct}}\n\nThe Republic of Elves (w:Estonian language|Estonian: Päkapikkude Vabariik), commonly known as Elves, was a micronation located in the northern territories of Estonia. Originally founded in 2016 and micronationed in late 2019, it \n\n{{Infobox country\n| Republic of Elves\n| common_name = Elves\n| native_name = Päkapikkude Vabariik\n| image_flag = NoFlag.svg\n| national_languages = Estonian\n| government_type = Republic\n| population_estimate = 3-5\n}}\n\nwas the second oldest known micronation in Estonia.<br />\n\n==Government==\nThe micronation was a republic, with the most powerful member being The President in Charge. Voting was allowed to all members above the Age of Powers. Check out the hierarchy https://docs.google.com/document/d/1xW86OUAtvPulJ5QQ_Nb3AcPyLbIII74urjaItXS4d28/edit?usp=sharing here. The President was noted to be friendly and cooperative with other members. \n<br />\n\n==Etymology==\n\nThe etymology is unknown, because the original founders have moved and lost interest in participating. The name is a direct translation from Estonian.<br />\n\n==History==\nThe Republic actually started as a parliamentary monarchy, but after the leader role was given to a new member, the form of government changed to republic. At its peak, the member count was 15-20, but after the Great Peace, the member count dropped to 3-5.<br />\n\n==Geography==\nThe Republic was located in the territories of Estonia, specifically in the northern county. It once expanded to the eastern counties, but after the Great Peace, the Republic surrendered the lands and continued in the north. The micronation did not have a capital, because it was based in a location, where a capital would be useless.\n\n==Law and Order==\nLaw and order is the most developed state sector.\n\n#The Defense Agency, or in Estonian, Päkapikkude Kaitseagentuur. It was the police force of the Republic with all members taking part. It has a self-developed penalty system and laws.\n#Tactical Support Team, or the military agency. With only the best involved, it was capable of preventing major accidents and dangers to the government.\n#Department of Official Documents gave out licenses and documents, thus keeping the Republic working.\n#Department of Communication and online platforms was responsible for anything related to communication and online platforms, including websites, blogs and social media pages\n\n<br />\n\n==Economy and income==\nMain income source was outsider taxes and penalty taxes.\n\nMain",
