    "websites": ["https://micronations.wiki/wiki/Republic of Avalonia", "|official_website       = https://www.avaloniagov.org/\n}}\n\nThe Republic of Avalonia (w:Lithuanian language|Lithuanian: Avalonijos Respublika), more commonly known as Avalonia, is a sovereign micronation situated within the United States. Avalonia claims territory in the North Peninsula of Wisconsin, as well as having an enclave in Chicago, Illinois. The Republic of Avalonia was founded on 13 August 2021, by the current President and Commander in Chief of the Avalonian Armed Forces (AAF), President James II.\n\nThe Republic of Avalonia holds claim to a independently-owned area of over 2 acres, or around 90,000&nbsp;ft² of territory, with the hopes of expansion within the near future. Avalonia also has an embassy within Lithuania. The main administrative office of Avalonia is located in downtown Chicago, with the Capital, City of Avalon, located within the Northern peninsula of Wisconsin. The Capital also hosts the AAF training facility, fit for advanced terrain infantry and naval training. The Republic of Avalonia is divided into two regions, the Central region, and the Northern region.\n\nThe Republic of Avalonia was initially established as an exercise of free and open political expression. The Republic of Avalonia is not only a sovereign micronation, but also an organization that strives to uphold ideals of free political, cultural, and creative expression. The Republic of Avalonia’s outreach project is active in Chicago, Illinois, where the organization works to inform high-school students on the importance and role of political science in daily life, involve students in local politics, and perform administrative tasks such as w:Voter registration|voter registration for the w:United States presidential election|United States presidential election.\n\n==Etymology==\nThe Republic of Avalonia derives its name from the word \"Avalonia\", a microcontinent in the Paleozoic era.\n\n==History==\n===Pre-Establishment Era (2018-2021)===\nThe Pre-Establishment Era of the Republic of Avalonia began in September 2018. This era of the nation did not have an established government, permanent population, or online presence. Plans were being created for establishing territorial control and establishing a democratic government. However, initial plans for a monetary system, a passport and immigration plan, an initial citizen base, and the creation of early versions of flags and arms were drafted. After three years of planning, the Republic of Avalonia was officially declared sovereign from the w:United States|United States of America on 13 August 2021 by incumbent President, James II.\n\n===Establishment Era (2021-Present)===\nThe Republic of Avalonia was formally established and declared independent from the continental United States on 13 August 2021. The declaration was written and signed by incumbent President, James II. The Government of the Republic of Avalonia is currently in the development stages and operates with a small ministry and Council of State. Incumbent President James II plays a large role in the day to day operations of the Republic and relies upon diplomatic relations to establish additional crucial pieces of legislature. The most active ministry during the Establishment Era is the Ministry of Foreign Affairs, conducting intermicronational talks and agreements. As of September 2021, Avalonia does not have a ratified constitution. Avalonia still maintains an active military and law enforcement presence, including the operation of the AAF (AIF, ANF, ACF, and ATAC), SIA, SCA, and PHG. On September 24, the Republic of Avalonias Ministry of the Interior, Ministry of Commerce and Office of the President released the Fisical Year Purchase Plan for the State.<ref>https://docs.google.com/document/d/1voU-EtdNL1lc6Lj7BWVhvynuWteLAKmv32qQMQBF-rE/edit?usp=sharing 2021-2022</ref>\n\n====Declaration of Independence====\n\n=====ACT I - The Establishment of the Sovereign State of the Republic of Avalonia<ref>The Establishment of the Sovereign State of the Republic of Avalonia: https://docs.google.com/document/d/1NXac5PAL34JaJUgXyJGxWxTaIORq8elqb66GukXpZUM/edit</ref>=====\nThe President of the Republic of Avalonia, expressing the will of the nation, decrees and solemnly proclaims that the execution of the sovereign powers of the Republic of Avalonia is established, and henceforth the Republic of Avalonia is declared a sovereign and independent state.\n\nThe Act of Independence of 13 August 2021 of the President of the Republic of Avalonia and the Council of State of the Republic of Avalonia decrees that on the day of 13 August 2021, the Republic of Avalonia formally declares sovereignty from the United States of America to create a state built upon foundations of political, cultural, and creative expression to be protected fully and indivisibly under the Constitution of the Republic of Avalonia.\n\nThe Republic of Avalonia stresses its adherence to universally recognized principles of international law, recognizes the principle of inviolability of borders, and guarantees political, cultural, human, civil, and ethnic community rights.\n\nThe President of the Republic of Avalonia, expressing sovereign power, by this Act begins to realize the complete sovereignty of the state of the Republic of Avalonia.\n\n==Politics and government==\n\n===Government Structure===\nThe Republic of Avalonia is a Semi-Democratic Constitutional Autocracy. The Government of Avalonia consists of the President, First Minister, and the Council of State. The First Minister presides over the Council of State, which is composed of 7 Ministers from the Ministries of Foreign Affairs, Defense, Treasury and Finance, Interior, Commerce, Justice, and Culture. Ministers, as well as the First Minister, are elected officials. Elections take place once every 3 years for these positions. The President retains the position indefinitely, and has the power to autonomously rule the state and the government. On 26 November 2021, the Ministry of Culture was established, with James II appointing incumbent Ieva D., notable for her work as a Lithuanian diplomat and culture and foreign affairs ambassador in Chicago, to serve as Minister of Culture.\n\nThe Republic of Avalonia uses a Unitary System of governmental organization. All government and state decisions are made by the President and the Council of State. Ministers are given equal power to pass legislature in their respective fields, but the President has the ability to veto or pass a piece of legislature, law, or policy independently from the Council of State via an executive order. The President also retains the ability to appoint or remove ministers by personal discretion, regardless of election results.\n{| class=\"wikitable\""],
