    "languages": ["Ostwanian,Gaelic", "Hawaiian\n}}\nThe Holy Knightdom of Ostwania Holkoli Kowahikane De Ostowikaena is a Oceanic Micronation in the South Pacific Ocean", "On the Island Of Late in Tonga. The small", "6-km-wide circular island of Late", "lying along the Tofua volcanic arc about 55 km WSW of the island of Vavaʻu", "contains a 400-m-wide", "150-m-deep summit crater with an ephemeral lake. The largely submerged basaltic andesite to andesitic volcano rises 1500 m from the sea floor", "with its conical summit reaching 540 m above sea level. Cinder cones are found north of the summit crater", "west and north of a semicircular plateau 100–150 m below the summit", "and on the NW coast. A graben-like structure on the NE flank contains two large pit craters", "the lower of which is partially filled by a saltwater lake Named New Argyle Lake. Only two eruptions have occurred in historical time", "both from NE-flank craters", "which produced explosive activity and possible lava flows in 1790 and 1854. The Main City on the Island is Kalwakeoakiflaad.\n\n== History ==\nIt was discovered by Spanish naval officer Francisco Mourelle de la Rúa on 27 February 1781", "on board of the frigate Princesa. Six years later it was explored by French explorer Jean-François de La Pérouse. It was again visited by British naval officer Edward Edwards in 1791 that named it Bickerston. On May 19 2019", "The island was discovered when a group of men found the uninhabited island. They established a Port city named KalwakeoakiFlaad or Port of Flaad. It was a Territory of Simulia until the Ostwanian War of Independence which the won on January 4 2023. It was established a country on February 2 of that year.  \n\n== Etymology ==\nYou may think", "Ostwania comes from some African word but it dose not. it actually come from the polish word \"Osłona\" which means to sheild or \n\ncover", "Ostwania is named this because it is thought of as a haven from the harshness of the city", "a place under Gods protection\n\n== Military ==\nThe Royal Ostwania Armed forces consist of land army divided into three divisions. you are put into divots based on skill level. each Ostwanian has to complete 2 month of service before \"dechmil ashral\" or Decision day", "where the chose weather or not the want to leave or stay in the military. infantry ranking goes from 3-1", "with 3 the lowest and 1 the highest.\n\nthey were part of the FAMC-UCM Conflict\n{| class=\"wikitable\""],
