    "websites": ["https://micronations.wiki/wiki/Dominion of Tucona", "official_website =\n}}\nTucona, officially the Dominion of Tucona and formally the United Colonies of North America, is a w:North America|North American w:Micronation|micronation established in 2021. It is a self-declared restoration of the w:United Colonies|United Colonies that existed prior to American independence, and claims the former Unions territories within the borders of 1776. The micronation seeks to achieve recognition as a w:Commonwealth realm|Commonwealth realm. The United Colonies exercises no authority over the territory it claims, nor is its existence acknowledged by w:Monarchy of the United Kingdom|the Crown or any sovereign nation. Nevertheless, the country maintains its seat of government and de facto embassy in the province of West Caesarea, and advocates for Tuconas self-governance.\n\nThe dominion was founded by w:Americans|American citizen Ronnie Miller as a project of self-government and historical education. However, it has developed into a cause of defending the w:Britishness|British origins and independence of the United Colonies. Tucona embodies the achievements of liberty and self-governance through the early years of the w:American Revolution|American Revolution, fused with the w:Rights of Englishmen|natural born rights of Englishmen.\n\n==Etymology==\nTucona is an acrostic of The United Colonies of North America, the original name of the w:Thirteen Colonies|Thirteen British American Colonies. The government maintains the long format as formal and historical name of the union.\nShortened forms include: the Union and the United Colonies.\n\n==History==\n===Colonial Period===\nMain article: w:Thirteen Colonies|Thirteen Colonies\n\n===Founding===\nIn 1775, the w:Second Continental Congress|Second Continental Congress convened to represent the grievances of the w:United Colonies|United Colonies, later acting as the de facto national government at the outset of the Revolutionary War. Through the w:Declaration of the Causes and Necessity of Taking Up Arms|Declaration of Causes and the w:Olive Branch Petition|Olive Branch Petition, the Continental Congress affirmed the United Colonies loyalty to w:Monarchy of the United Kingdom|the Crown. It was only after King George III issued the w:Proclamation of Rebellion|Proclamation of Rebellion on 23 August 1775, that the United Colonies moved towards independence.\n\nThe government of Tucona maintains that the original cause of the Continental Congress is just, and carries the positive attributes of the American Revolution while remaining loyal to the crown.\n\n===Independence===\nThe short-lived Dominion of Hartland was formed on 19 April 2021 by local residents to protect the original mission of the Second Continental Congress in allegiance to the crown. By 25 April, an Act of Union was formalized to create Tucona, the modern successor state of the 18th century United Colonies. Hartland became the first province to enter the federation. Tucona joined the Commonwealth of British Dominions initially as Hartland on the date of its independence.\n\n===Early Actions===\nThe government of Tucona arose as a moderate, non-intervening force during the Vancouver Island territorial dispute, later defending the rights of self-determination of the residents of Vancouver Island. Following the establishment of the second Dominion of Vancouver Island, Tucona established a period of hesitancy to fully recognize their sovereignty. Tucona withdrew from the Commonwealth of British Dominions due to disagreements with internal members in the aftermath of the Vancouver Island dispute.\n\n===Restoration===\nAfter a period of decline, the Dominion of West Caesarea and the Delaware was founded from a brief restoration of the w:Oliver Cromwell|Cromwellian w:The Protectorate|Commonwealth of England, Scotland and Ireland. This new dominion was itself a restoration of the 17th century w:West Jersey|Province of West New Jersey, assuming its historical name. HM Government of West Caesarea announced their intention to restore Tucona to a proper dominion and aspiring Commonwealth realm.\n\n==Overview==\n===Territory===\nTucona claims the entirety of the former United Colonies territory, asserting its sovereignty over the lands before American independence. In reality, the governmental authority of the Union is limited to small provinces and territories of its citizens.\n\n===Culture and Laws===\nThe national identity of Tucona is one of pride in British colonial history, and traditional American values.\n\n===Government and Politics===\nTucona is governed as a w:Federalism|federal w:Semi-parliamentary system|semi-parlimentary w:Constitutional monarchy|constitutional monarchy. King Charles III is the nations Monarchy of Tucona|monarch and head of state, although this claim is not currently acknowledged by His Majesty, or the government of any other Commonwealth Realm. The highest government official within the United Colonies itself is the President-General who represents the monarch and the interests of the citizens of Tucona. The President-General is nominated by the Grand Council of Tucona|Grand Council and confirmed by the monarch. During the President-Generals tenure, they must rely on the confidence of the Grand Council and the monarch to maintain their position. Candidates for political office are chosen directly by their constituents, and elected to power by simple popular vote. The countrys legislature is the w:Unicameralism|unicameral Grand Council of provincial governors.\n\nThe United Colonies form of government is heavily influenced by the 1774 w:Galloways Plan of Union|Plan of Union proposed by w:Joseph Galloway|Joseph Galloway, a w:Province of Pennsylvania|Pennsylvania delegate to the w:First Continental Congress|First Continental Congress.\n\n====Legislature====\nThe Grand Council of Tucona|Grand Council is composed of the governors of the provinces of Tucona, appointed by the President-General and confirmed by all present members of the Council.\n\n===National Symbols===\n{{Main|National symbols of the Dominion of Tucona}}\n<center><gallery perrow=\"5\" heights=\"100px\" widths=\"100px\">\nFile:Flag of Tucona.png|border|w:Grand Union Flag|National Flag\nFile:Flag of the United Kingdom.svg|w:Flag of the United Kingdom|Royal Union Flag\nFile:Arms of Tucona late 2021.png|Coat of Arms\nFile:GreatSealTucona late 2021.png|Great Seal\n</gallery></center>\n\nTucona adopted the w:Grand Union Flag|Grand Union Flag as its national flag. It is not known for certain when or by whom the design of the Grand Union Flag was created, but the flag could easily be produced by sewing white stripes onto the British w:Red Ensign|Red Ensigns. The first flag to be flown has been credited to w:Margaret Manny|Margaret Manny. The Grand Union Flag has 13 alternating red and white stripes, representative of the Thirteen Colonies. The upper inner corner, or canton, featured the flag of the w:Kingdom of Great Britain|Kingdom of Great Britain, of which the colonies had been subjects.\n\n==Provinces and Territories==\nTucona is composed of Provinces and Territories, with their own local governments represented in the Grand Council.\n{|class=\"wikitable\""],
