    "capital": "Vienna (Ceremonial)",
    "currency": "Katzen Krone}}\n\nThe Kingdom of Katzburg, officially the Lands of the Grand Katzen Crown of Vienna and Germany, commonly called the Katzen Empire or simply Katzburg, is a sovereign American and Austrian micronation that is based in the city of New Berlin, USA, and has a ceremonial capital in Vienna, Austria (though Katzbach does not exercise control over its capital). The Kingdom declared independence from the United States in August 2022. Katzburg has an estimated population of 7 as of 2022, all of whom reside in the city of New Berlin.\n\nThe Kingdom takes the form of an enlightened absolute monarchy, with the Kaiser ruling for the most part without restraint, but respecting the traditions of the Monarchy, some civil liberties, and the authority of the Marshal-Admiral, who has complete and total control over the armed forces. While the Kaiser and Marshal-Admiral can be the same person, they are traditionally separate titles held by separate members of the Imperial family.\n\nThe official languages of the Kingdom are English, which is primarily spoken, and German, which is the native language of Vienna. However, Urdu and Spanish are also used by some subjects.\n\n==History==\n\nOn August 21, 2022, the Kingdom was officially declared. Francis I was unanimously chosen as the first Kaiser by the Imperial family, and Charles Schwarzenberg was immediately confirmed as his deputy and as the Marshal-Admiral, with complete and undivided authority over the small Katzen Army and Navy.\n\nOn December 19, 2022, the Kaiser resigned, causing a crisis within the country. Anti-government protests had been going on for weeks, and the Marshal-Admiral had resigned himself in secret support of the rebels. The mercenary army quickly deserted, and the local legion got bogged down in thick mud while attempting an operation against the US, so there were temporarily no troops in the capital to restore order. The rioters, disgruntled by the increasing feudalism of the government, seized their chance and overthrew all remaining authorities. However, before they could consolidate power, in the \"Christmas Coup,\" a group of aristocrats took control and decreed the independence of the Kazan territory, to which they then fled and established a new, prosperous monarchy, bringing the Katzen treasury and army supplies with them. In the main old Katzen territory, a chaotic democracy was formed and soon plunged into turmoil and rioting.\n\n==Government==\n\nAccording to the soon-to-be-completed Katzen Constitution, the Kaiser has complete control over the Kingdoms domestic policies. However, it is the custom of the monarchy to respect traditions and some freedoms. Therefore, there is much debate amongst the subjects of the Kingdom about policy, however the final decision is made only by the Kaiser. He is deputized by the Marshal-Admiral, who also controls the Katzen Army, Navy, and the Kingdoms foreign policy.\n\n==Economy==\n\n{{Empty section|date=July 2023}}\n\n==Foreign Relations==\n\nCurrently, the Katzen Empire recognizes the following macronations and micronations:\n{| class=\"wikitable\"",
