    "motto": "|\"Pro libertate et felicitate\"",
    "contactInfo": ["{{Draft submission|t||ts=20221224142324|u=Chanceler of Cabode|ns=3000|demo=}}<!--- Important, do not remove this line before article has been created. --->\n{{Infobox country"],
    "websites": ["https://micronations.wiki/wiki/Draft:Communist Republic of Cabode", "\n}}\nThe Communist Republic of Cabode (República Comunista do Cabode in Portuguese) is a micronation in Portugal.  The new formed republic mantain the same politics as the Free Principality of Cabode. This politics are focused on peace, liberty, fraternity, equality and happiness.\n\n==History==\nOn november of 2021 The Free Principality of Cabode claimed is independence, starting with a princesse and a provisional government until the elections.\n\nAfter the first elections the communist party won and started the rule of communism in Cabode.\n\nThe Principality of Cabode had nine months of government until the red christmas revolution when the communist party achieve the full power in the senate and proclaimed the Communist Republic of Cabode.\n\nEnding the Free Principality of Cabode on 24th of December 2022 and begining the Communist Republic of Cabode.\n\n=Politics=\nThe new Communist Republic wants to make distance from the soviet communism, as a result the Cabodes provisional government created the Cabodean Communism. \nThis communist ideology follow the true words of Carls Marx in the manisfeto of communism and protects all communist supporters as well as all the workers in the world.\n\n=Culture=\nThe most popular game in Cabode is snooker, which is played by every cabodean. Sometimes there is the cabodean tournament (CT), that consists in a snooker tournament and occurs regularly.\nOne of the greatest dishes in Cabode is \"arroz doce\", a portuguese sweet pudding but with a special touch of Cabodes culture.\n\n=Proviencies=\nThe Principality of Cabode has three provinces:\n\n- North Cabode;\n\n-South Cabode;\n\n-Balças de Aço;\n\nThe province of North Cabode is where housing, markets and livestock are located.\n\nSouth Cabode is where the vegetable crops are.\n\nBalças de Aço is where we harvest olives to produce olive oil.\n<br />\n=Economy=\nCabodes economy is basically an agriculture economy. The main products are olive oil, seasonal fruit and vegetables. Beyond that, wood industry has a great impact, to prevent our houses from being very cold in winter. Another big sector of our economy is the livestock industry, which produces eggs and chicken and duck meat. Cabode does not export anything and only has a subsistent economy.\n\nCabodes economy is eco-friendly. Absent of pesticides in agriculture and plating native vegetables and trees.<br />\n\n=Foreign Affairs=\nCabode has a friendly vision with all cultures and nations, being able to negotiate with everyone with respect. However, to start some discussions with Cabodes foreign minister, some requirements are necessary:\n\n- Human rights must be respected in the nation;\n\n- Both nations discuss with respect and friendship;\n\n- Recognitions of sovereignty must be mutual.\n\nAnyone who wants to get in touch with Cabode to start diplomatic relations can send an email to the address: freeprincipalityofcabode@gmail.com\n\n\n\nMutual Recognition\n{| class=\"wikitable sortable\" style=\"float:center; text-align:center; white-space:nowrap\"\n! width=\"35px\" class=\"unsortable\" |Flag\n! width=\"120px\" |State\n! width=\"90px\" |Capital\n! width=\"35px\" |Pop.\n! width=\"75px\" |Area"],
