    "capital": "{{Orphan|date=July 2023}}\n\n{{Infobox country\n| Républic of Bermond Island\n| common_name = Bermond Island\n| status = Active\n| image_flag = Flag-bermondisland.png\n| alt_flag = Flag of républic of Bermond island\n| image_flag2 = Logo-ileBermond.png\n| image_coat = Blason-Bermond.png\n| alt_coat = Coat of arms of Bermond Familly\n| symbol_type = Coat of arms\n| \"Never give up\"\n| national_anthem = \"National anthem\" <!-- If an audio file for the anthem exists, add {{subst:Anthem spacer}} File:Example anthem file.ogg </div>-->\n| image_map = Map-apple-bermond-island.png\n| map_width = 250 <!--(In pixels)-->\n| loctext = île Bermond, Marseille, France\n| map_caption = Territories of Bermond Island\n| image_map2 = <!--Another map, if required-->\n| alt_map2 = <!--alt text for second map-->\n| map_caption2 = <!--Caption to place below second map-->\n| largest_city = MARSEILLE\n| French, English\n| national_languages = French,\n| regional_languages = Provençal, Esperanto\n| ethnic_groups = {{plainlist|\n* 50% Local\n* 50% Worldwide}}\n| ethnic_groups_year = 2023\n| religion_year = 2023\n| demonym = Decentralized\n| government_type = w:Decentralized|Decentralized w:Monanarch|Monanarch w:republic|republic\n| leader_title1 = Monanarch\n| legislature = Agora to OnBoard citizen and Parliament by Network\n| sovereignty_type = Independence\n| sovereignty_note = from w:France|France <!-- Link to Wikipedia page of the macronation declared independence from, can sometimes be a link to the MicroWiki page of another micronation.-->\n| established_event1 = Independence\n| 25 septembre 2022 à 9h50\n| established_event2 = Constitution ratified\n| established_date2 = wip\n| percent_water = 90%\n| population_estimate = 30\n| population_estimate_year = \n| population_census = \n| population_census_year = \n| nummembers = 21\n| MicroWiki:MicroProject Copy Edit/Nation page guide/Example currency|Coco\n| time_zone = w:Example Standard Time|XST <!--UTC is NOT a time zone!-->\n| utc_offset = -2\n| time_zone_DST = w:Example Daylight Time|XDT\n| utc_offset_DST = -1\n| DST_note = <!--Optional note regarding DST use-->\n| date_format = mm/dd/yyyy\n| drives_on = right\n| cctld = .dao\n| calling_code = w:+1|+1\n| {{url|https://nicolas-bermond.com/e-reputation/ile-bermond}}\n}} \n{{Infobox family|name=Bermond FamillyBlason-Bermond.png|alt_flag=Coat of arms of Example|native_name=|native_name_lang=|other_names=|type=Crypto Monanarchy|parent_family=Clan of Bermond der Burgonden|country=Burgundians|etymology=Bear protector|origin=<!-- Country, region, town, location etc. of origin -->|founded=245|founder=Bermond der Burgonden|current_head=Nicolas II fr|final_ruler=<!-- I.e. last sovereign; applicable primarily to sovereign aristocratic dynasties -->|titles=Crypto Monanarch|members=50|website={{URL|https://nicolas-bermond.com/openlife-moi/la-maison-bermond}}|footnotes=WIP 60%|motto=plus fidei et fidelitati quam vitam}}\n\nThe Bermond Islands (les îles Bermond<ref>https://nicolas-bermond.com/e-reputation/ile-bermond</ref> in French) are first of all a global program of a micronation, a work on roots and history of family Bermond, a game of e-reputation to play with full power of GAFAM and a lab to design and develop a full service of governance (DAO<ref name=\":0\" />). This project could be qualified of research, art and developpement.\n==Location==\nThe Bermond island are a group of islands located in France. The first one is located in Sigean<ref name=\"persee.fr\">https://www.persee.fr/doc/anami_0003-4398_1977_num_89_131_1666</ref> and was for a long time called Sainte Lucie, but medieval sources almost always prefer to refer to this island under the much older name of Ile de Cauquenne or Ile Bermond. The second one is in the national park of the Calanques in Marseille\n\n(GPS 43°1648.0\"N 5°1709.8\"E)\n\nThere are certainly others that have not yet been identified. \n==Micronation==\nThe idea of republic and micronation is anchored in the Family since the dawn of time. They fought against Saint Louis in the 12th century who wanted to reunite the kingdom of France. The Bermond who did not wish a centralization of the power lost in an unequal fight, Anduze, Sauve and Sommières.<ref>https://www.midilibre.fr/2013/06/06/histoire-de-la-famille-bermond,712054.php</ref> The Republic of the Bermond Islands was born with the aim of promoting decentralization and putting freedom as a principle of life at the heart of all decisions.\n\nThe republic of Bermond Islands, self-proclaimed as a micronation in 1340, aims to reflect on virtual-real borders and decentralization. It has since 1200 studied property rights that protect it from the abuses of the royal officials.<ref name=\"persee.fr\" /> For the Bermonds centralization is a major problem for humanity. Today, as a descendant, Nicolas II Fr (Nicolas Bermond) decided to exploit it again to make it a space of freedom. Taking up the values of the Bermond coat of arms \"Libertas tamquam principium vitae et illimitata libertas\" Freedom as a principle of life and freedom without limits. For this reason, it offers citizenship to people who have the ambition to open new roads, new ways and therefore the possibility to live differently. The objective is to encourage encounters and love by opening a space where individuals have the possibility to express themselves and create freely. But above all, to give everyone the means to blossom and express themselves in an authentic way. The Republic of the Bermond Islands recognizes the Free Republic of Frioul.\n\n==Etymology and coat of arms==\nMore faith and fidelity as a model of life, or, a bear rampant sable gorged with a harness argent, supporting a sword sheathed with the same. The name Bermond, meaning, in old Germanic language, \"valiant bear\", the bear armed with a sword is also well placed in the arms of this family. The Bermond family is one of the oldest in France, since, as early as the time of Charlemagne, in 813, a Bermond was governor of Lyon and count of Auvergne.\n\n==History==\nThe island Bermond of Sigean, Bérenger the not insignificant sum of 4000 under of the same currency to repurchase the fief which held in the island Bermond of Sigean and the summary of the act is interesting in that it shows that it was necessary to push aside on this occasion the claims of the viscount of Narbonne Aymeri III. The island Bermond of Marseille has a Germanic origin berthmund, resulting from the root berhaut famous, brilliant and mund which means protection. This island belongs to the Bermond family. It is attached to the islets of Tiboulen du Frioul is an islet of 30 meters high, west of the archipelago of Frioul, in the harbor of Marseille. Called for a time the islet of the pirates, it was often considered as a strategic place of the Phocaean city. Bermond Island was given by https://saint-louis-a-aigues-mortes.com/2017/04/09/quand-histoire-et-histoire-familiale-se-conjuguent-a-aigues-mortes/ Saint Louis confiscating Sommières from the Bermond family which became property of the Crown because Sommières was at the time the first important stronghold upstream from Aigues-Mortes, and therefore necessary for the protection of the future port towards the interior. The large Bermond tower, which still dominates the city, testifies to the importance of the fortifications. Is it by concern of conciliation... Saint Louis compensated Bermond-Sommières with the small seigneury of Caylar, in the diocese of Lodève, and left them the tiny island of Bermond opposite Marseille (île Bermond).\n\n==Manifesto==\nWe all deserve Love with a",
