    "motto": "   Fight for what you believe to be right",
    "contactInfo": ["{{poor}}\n{{Inactive}}\n{{Infobox country\nKingdom of Numenor\n|image_flag =         File:NoFlag.svg|200px\n   Fight for what you believe to be right\n|englishmotto =       <!--English language version of motto-->\n|national_anthem =    \nWillow\nEnglish\n|government_type =    Constitutional Monarchy\n|leader_title1 = Current leader\n|leader_name1 = King Jeremy Bellamy I\n|established_event1 = Foundation\n August 2005\n|nummembers =         6000\n|nat_animal =         Pigeon\n}}\nCategory:Pages using an automatically generated Infobox country\n\nThe Kingdom of Numenor is a micronation founded in August 2005 and is a constitutional monarchy.\n\nNumenor is a secessionist micronation located in the UK claiming vast amounts of land in Lincolnshire, England.\n\n==Terminology==\n\nThe country started off under the name of The Kingdom of Willow, flying a brown flag with a green cross. In November 2005 a communist revolution took place and King Jeremy was removed. After two weeks the King returned to the nation and removed the communists, to wide spread relief throughout The Kingdom of Willow. After this unpleasantness the King wanted a new start so he renamed the nation The Kingdom of New Brittania and adopted the current flag. The parliament voted to change the Name to Numenor\n\n==History==\n\nIn August 2005 Jeremy Bellamy chose to break away from the UK to develop a country with a sense of self pride. The nation was originally called the Kingdom of Willow and the flag was brown with a green cross, since then the name has changed and the old British flag has been adopted. One relic from this period still survives however. The national currency, the FONS, which is equal exactly to ten British pounds, remains and grows stronger each month. \n\n\n\nArticle from the New Brittanian Site\n\n\n\nThe King is confirmed to be a far distant relative of William Shakespeare, he is descended from Shakespeares sister Joan and William Hart (see below.). \n\nhttp://www.shakespeare-w.com/image/sha_familytree.gif  \nThe Nations Coat of Arms is also the coat of arms for the Hart family, as shown below.\n<br>\n\n==Politics==\n\nThe nation is led by King Jeremy I, a monarch who has a lot of power over the micronation. In his support is a parliament made up of competing parties. The ultimate prize for any party is the Prime-Ministerial position.\n\nSadly, the first ever Prime-Ministerial election was void due to a fraud leading to someone voting 13 times for the same person, but it didnt affect the final vote, Nathan Melton still won the elections.\n\nOn Monday 6 March 2006, Nathan Melton announced that he was stepping down after just a month in the role of Prime-Minister of the nation. Replacing Melton is Deputy Prime-Minister, Melton has now stepped down to deputy role.\n\n==Diplomatic Relations/Foreign Affairs==\n\nAllies\nGosling<br>\nNew Empire<br>\nNew Oscland<br>\nSPQR<br>\nSouth Tchistanski<br>\nWoodstania<br>\nMercia \n\nEnemies\n\nNone\n\n==Geography==\n\nNumenoris made up largely of farm land with a few villages containing the majority of the nations population. The climate is the same as that of the UK, cloudy with occasional spells of sunshine or rain. A series of small streams run through the country making up a system of water ways, the streams flow down the many hills of the nation. Despite being in an allegedly flat county, this is not the case.\n\n==Armed forces==\n\nThe NeNumenor royal army consists of roughly 20 people, some of these occasionally ride horses when the horses are available. The main task of this force over recent months has been expansion, with vast amounts of land being captured in the UK. The Air Force is very small at the moment, as is the navy, which was largely destroyed last year.\n\n==External links==\n\n*http://www.freewebs.com/newbrittania The old website\n*http://www.kingjeremy.proboards51.com Numenor "],
