    "currency": "{{Orphan|date=July 2024}}\n\n{{red links}}\nThe Banana Republic is a micronation located on both the North American and Asian continents. The nation was founded on October 3, 2012, and on April 14, 2014, entered the Microwiki community. The nation is a Federal Semi-Presidential Republic comprised of thirteen \"provinces\". The incumbent president is Joe Jenkins and the incumbent Head Senator and Prime Minister is Kirk Jenkins. The nation has membership in the Micronational United Nations which also includes Minion Republic.\n\n== History ==\n\n===Early Development===\n\nThe Banana Republic was founded on October 3, 2012, as the \"Mouse Kingdom\" as an absolute monarchy along with its rival at the time the \"Panda Kingdom\". The Mouse Kingdom originally comprised of just what is now Capital District,BR. The Mouse Kingdom soon expanded into small areas of what is now Home Province . On October 4 the nation changed its name to the Banana Republic despite still being an absolute monarchy. On October 10 the Banana Senate was established as the first elected government organ with the first senator being Joe himself representing Capital District this was the first step to Banana Democracy although needed the approval of the emperor first before passing a law while the emperor himself could pass a law without the approval, this early form of Banana democracy has been dubbed a \" hierarchial democracy\" by Banana Politicians. On October 15 war broke out between the Banana Republic and the Panda Kingdom over what is now South City the Banana Republic won in a landslide, the war is now called the Banana-Panda War. The following day the Banana Republic invaded and occupied a small playground now known as the New Parka Fort. Also on that day Home Province was incorporated as the \"Home Territory\" the second ever province in the Banana Republic, up until that point the entire was administrated by Capital District. On October 18, 2012, the Panda Kingdom joined as the province of Tyom and gained a seat in the senate, the next day an imperial decree declared Capital Districts withdrawal from Senatorial Representation.\n\n===The Collumian Wars===\n\nOn November 2, 2012, while trying to put down a rebellion by Tyomian separatists an attack was carried out by a hostile enemy dubbed the \"Kyomians\" the war was actually four different wars occurring on the same day and in the same area with an extra war occurring on November 8, 2012. The war ended in Banana Republic victory, while the Kyomians formed their own micronation-Kyom. The war brought together pro-government and anti-government forces together for the first time ever and also allowed the Banana Republic to rise as a regional superpower and enter the classical era of its history.\n\n===The Classical Era===\n\nWhat followed was a long-term period of Banana supremacy in regional micronational affairs, the creation of the office of the Prime Minister of the Banana Republic. It also was marked by countless wars, subversion and high levels of corruption. On November 12, 2012, the province of Loofta was created from the client state of the Tyan Rock Pool Kingdom led by Joe himself. Also on that day Bill Khan was elected as the first ever office of the prime minister. This was also the day when separation of powers was used rather than the \"Hierarchial Democracy\" of the past. Also during November of that year the first political parties were created- the Libertarian Party and the Sasa Island Party which later became the Yoyo Party. Tyomian pro-independence movements often led to rebellions and conflicts yet again between them and the central government. These included the First Tyomian War and the Second Tyomian War.  Forms of subversion such as the Bill Crisis happened frequently to infrequently in the Banana Republic. Also during this time a \"modern\"",
