    "currency": "{{Improve}}\n{{TranslateIntoEnglish}}\n\n== O Império Maragato ==\né mais que uma micro nação.Trata-se de uma reivindicação de Terras que formariam um Trono Imperial pela antiga Dinastia da Casa Silveira Ramos que tem sua descendência pura mais direta no morgado na Família Silveira Fortes. Os Membros da Casa Imperial Maragata afirma que foram roubados e oprimidos pelo Governo dos  Bragança e pelo Governo Republicano Brasileiro,Argentino e Uruguaio. É mais do que uma micronação. Trata-se da reivindicação da sombra da terra conhecida formarii um Trono Imperial pela Antiga Dinastia Casa de Silveira Ramos naquela época em que ele descendeu Morgado puro no mais sério da Família, o forte Silveira. A boca dos membros dos oprimidos da Casa Imperial Maragata afirma pelo Governo de Bragança e pelo que eles foram roubados do governo republicano brasileiro, argentino do uruguaio.File: bandeira de casa pronta.jpg\n\n== A Família Silveira Fortes ==\n A Família Silveira Fortes descende diretamente dos estancieiros donos das terras na época da primeira revolução federalista. The Silveira Fortes Family descended directly from the landowners who owned the lands at the time of the first federalist revolution.\n== O Objetivo ==\n O Império Maragato tem como objetivo estabelecer uma monarquia separada da República Brasileira com total autonomia de governo tendo em vista as tradições castelhanas e portuguesas da Borgonhesa Astorga desde os primórdios dos Territórios do atual Rio Grande do Sul,quatro províncias argentinas contíguas e o território do atual Uruguai.Desde Leodato I o império se utiliza do fracionamento administrativo para expandir a sua influência ligando vários condados e principados a fim de dominar 51% dos território reivindicados.O Império Maragato estabelecido em 1905 e consolidado em 1914 com a organização de Don Manuel da Silveira ao casar sua filha e primeira herdeira com o Senhor e Titular do Morgado Feudal da Silva Borges Fortes pela descendência de Don Gabriel.Assim foi restabelecida a \"união itaquium sul e blanco norte\" (atual Região campanha e Região Missioneira) através do tratado da Volta Rondinha aumentando a influência da Família.The Maragato Empire aims to establish a separate monarchy of the Brazilian Republic with full autonomy of government in view of the Castilian and Portuguese traditions of the Borgonhesa Astorga from the beginnings of the Territories of the present Rio Grande do Sul, four contiguous Argentine provinces and the territory of the current one Uruguay. From the Governments of the Emperors Demetrius I and Leodatus I the empire uses the administrative fractionation to expand its influence linking several counties and principalities in order to dominate 51% of the territory claimed. The Maragato Empire established in 1905 and consolidated in 1914 with the organization of Don Manuel da Silveira when marrying his daughter and first heir with the Lord and Titular of the Morgado Feudal da Silva Borges Fortes by the descendants of Don Gabriel. Thus it was reestablished the \"union itaquium south and white north\" (current Region campaign and Mission Region) through the treaty of Volta Rondinha increasing the influence of the Family.\n== A Perda do Poder sobre o Território ==\n A partir de 1930 varias rebeliões ocorreram sob a chefia da Família Dorneles Prestes do Amaral com o objetivo de aniquilar o poder da Família Silveira Fortes com a ajuda do movimento Coluna Prestes que inclusive teve participação no atentado a Casa de Intendência em São Franscisco de Borgia,atual São Borja.Essas rebeliões e a sede de poder dos Prestes do Amaral ao lado das Famílias ximangas que haviam vencido a guerra se uniram com os turcos e gringos para esmagar de vez a influência maragata que estava representada pelo comando da poderosa Família Silveira Fortes.From 1930 onwards several rebellions took place under the leadership of the Dorneles Prestes do Amaral Family with the objective of annihilating the power of the Silveira Fortes Family with the help of the Prestes Column movement which also had participation in the attack on the House of Intendance in San Franscisco de Borgia, current São Borja. These rebellions and the thirst for power of Prestes do Amaral alongside the ximangas Families that had won the war united with the Turks and gringos to crush the maragata influence that was represented by the command of the powerful Silveira Fortes Family.\n== A Tentativa de Reconquista ==\n A partir de 1999 a Família Silveira Fortes vem se articulando politicamente através de vários círculos de discussões políticas em todo o Rio Grande do Sul e Santa Catarina com o objetivo de lançar a idéia do restabelecimento da Monarquia Maragata. Since 1999 the Silveira Fortes Family has been articulating politically through several circles of political discussions throughout Rio Grande do Sul and Santa Catarina with the aim of launching the idea of ​​the reestablishment of the Maragata Monarchy.\n== O Período Atual ==\n File: O imperador Don Nery II e a Imperatriz Dona Cleusa 02.png Em 3 de Agosto de 2017 a Chefia da Família Silveira Fortes passou para o 4º Senhor do Morgado da Rondinha Don Nery da Silveira II que assumiu o trono da Casa Real e Imperial além da Chefia Geral dos Cavaleiros da Ordem de Santa Luzia um mês após o falecimento de seu pai em total acordo com o Estatuto da Família Silveira Fortes.O governo de Don Nery II passou a ser um período mais conturbado pois logo que assumiu ele deu publicidade aos movimento de reconquista do poder e depois disso tornou público que estaria recolhendo assinatura em várias Atas para conseguir que 51% da população desse legitimidade para estabelecer uma espécie de \"Governo Paralelo\".Hoje o \"Governo Paralelo\" do Império Maragato começa a engatinhar através do projeto de impostos pagos pela população a Casa Imperial.O 4º Senhor Don Nery II foi pioneiro na elaboração da implantação do Imposto único e do incentivo a total autonomia do império.A Medida que o Governo Paralelo for crescendo Don Nery II planeja a implantação de uma nova moeda lastreada em minérios como o topázio.On August 3, 2017, the Head of the Silveira Fortes Family passed to the 4th Lord of the Morgado da Rondinha, Don Nery da Silveira II, who assumed the throne of the Royal and Imperial Households and the General Leadership of the Knights of the Order of Santa Luzia one month after the death of his father in full accordance with the Statute of the Silveira Fortes Family. The government of Don Nery II became a more troubled period as soon as he took office he publicized the reconquest of power and afterwards made it public that he would be collecting a signature in several Acts to get 51% of the population of that legitimacy to establish a kind of \"Parallel Government\". Today the \"Parallel Government\" of the Maragato Empire begins to crawl through the project of taxes paid by the population to the Imperial House. The 4th Mr. Don Nery II was pioneer in the elaboration of the implantation of the Single tax and the incentive to the total autonomy of the empire. As the Parallel Government grows, Don Nery II plans the implementation of a new",
