    "capital": "{{defunct}}\n{{poor}}\nFile:Flag of Mundai.png\n\nThe Empire of Mundai was created on March 24, 2011. It was created as a political reform of the Absolutist Republic of Gratisia.\nThe Empire turned into a Democratic Socialist Republic on April 1.\n\n== Districts and Territories ==\n\nCarolina District:\n*Azuland\n*Briceland\n*Evergreen\n*Pics Soeur\n*Fluss Province\n\nNorthland District:\n*Eutimio de Soto Is.\n*Mundai Canada\n\nGrand Dakota District:\n*Oahe\n*Plaines Froides\n\nAntarctic District:\n*Freiantaca\n\nGigangi District:\n*El Monte Bajo\n\n== Government ==\n\nMundai Government is made up of a President and a Senate.\n\nPresident\nThe role of the President in the government is to propose new laws, engage in foreign relations, and to take charge of conflicts. He mostly talks with the Senate of the nation.\n\nSenate\nThe senate of Mundai is made up of a senator from each district. They vote upon matters of law and government. Senators are chosen based upon their popularity with the people, and their intelligence.\n\n== Currency ==\n\nThe currency used in Mundai is the Mundai Stamp.\n\nThe stamps are small, aluminum coins that are used frequently.\n\n1ST=1 Stamp=.20USD\n\nThere are also paper notes for large amounts of stamps.\n\n== Culture ==\n\nMundai are diverse and good people.They commonly are funny and normally are cool.\n\nHolidays\nThey celebrate a few holidays\n\n1/1- New Years Day\n\n3/24-Imperium-celebrates empirical founding\n\n4/29- Jerolin Day-The Emperors Birthday\n\n6/21-Summer Solstice Festival\n\n10/24-Gratisian Day-Celebrates original micronation of Mundai\n\n10/31-Halloween\n\n11/11-Armistice Day-Celebrates cease-fires and Veterans\n\n12/21-Winter Solstice Festival\n\n12/25-Christmas\n\nOther holidays may be celebrated for personal or religious reasons.\n\nNational Anthem: Spirit Never Dies-Masterplan\n\n",
