    "contactInfo": ["Neue Slowenische Kunst (NSK), German for \"New Slovenian Art\" is a controversial political arts collective originating from Trbovlje, Slovenia in 1984. At that time Slovenia was part of the Socialist Federal Republic of Yugoslavia. \n\nNSKs best-known member is the industrial music group Laibach. Other NSK group include IRWIN (painting), Noordung (theater), New Collective Studio (graphics; also known as New Collectivism), Retrovision (film and video), and the Department of Pure and Applied Philosophy (philosophy). State of Art, 2004, Hackett, 2004, http://www.laibach.nsk.si/l7.htm, http://www.ljudmila.org/embassy/1a/what.htm, http://www.ljudmila.org/embassy/5a/retro.htm The founding groups of NSK were Laibach, Irwin, and Scipion Nasice Sisters Theater, which later became Noordung. http://www.gla.ac.uk/~dc4w/laibach/laibach1.html, http://www.gla.ac.uk/~dc4w/laibach/noordung.html The theatrical arm of NSK has also gone under the name Red Pilot.\n\nBoth IRWIN and Laibach are emphatic about their work being collective rather than individual. Laibachs original songs and arrangements are always credited to the group collectively; the individual artists are not named on their record jackets or CD sleeves; at one point, there were even two separate Laibach groups touring at the same time, both with members of the original group. Similarly, the IRWIN artists never sign their work individually: instead, they are \"signed\" with a stamp or certificate indicating approval as a work from the Irwin collective.\n\nNSK art often draws on symbols drawn from totalitarianism|totalitarian or extreme nationalist movements, often reappropriating totalitarian kitsch in a visual style reminiscent of Dada. NSK artists often juxtapose symbols from different (and often incompatible) political ideologies. For example, a 1987 NSK-designed poster that caused a scandal by winning a competition for the Yugoslavian Youth Day Celebration appropriated a painting by Nazi artist Richard Klein, replacing the flag of Nazi Germany with the Yugoslav flag and the German eagle with a dove. Hackett, 2004\n\nSince 1991, NSK claims to constitute a http://www.ljudmila.org/embassy/1a/state.htm state, a claim similar to that of micronations. They issue passports http://www.ljudmila.org/embassy/2a/2a.htm, http://www.ljudmila.org/embassy/3b/irwin17/amst.htm, and have presented shows of their work in the guise of an embassy http://www.ljudmila.org/embassy/3b/irwin13/moskva.htm, http://www.ljudmila.org/embassy/3b/irwin14/gent.htm or even as territory of their supposed state http://www.ljudmila.org/embassy/3a/state/state.htm; they maintain consulates in Florence, Italy http://www.ljudmila.org/embassy/3b/irwin16/flo.htm and Umag, Croatia http://www.ljudmila.org/embassy/3b/irwin20/umag.htm; and have issued postage stamps. http://www.ljudmila.org/embassy/1b/nka.htm\n\nThe NSK were the subject of a 1996 documentary written and directed by Michael Benson, entitled Prerokbe Ognja in Slovenian, or Predictions of Fire in English. http://query.nytimes.com/gst/fullpage.html?res=9C06E0DA1F3CF931A35753C1A960958260\n\n==See also==\n* Elgaland-Vargaland, another artist-driven micronation-project\n\n==External links==\n* http://www.nskstate.com Official website of NSK\n* http://homepage.tinet.ie/~peterc/a/nsk.html A thesis about the political aims of NSK\n* http://www.ljudmila.org/nsk/1.html NSK global state and http://www.ljudmila.org/embassy/ electronic embassy\n\n==References==\n* Anonymous, \"State of Art: the new Slovene Avant Garde\" (2004). Northwest Film "],
