    "contactInfo": ["{{Orphan|date=July 2023}}\n\n{{Micras}}\n{{Defunct}}\nStorej is a Marxist state in Leng and micras:Apollonia|Apollonia bordered by Elwynn, Amokolia and Hurmu and Frazenland with an area of 377,568 square kilometres in total area. Though the president was a critic of Micras he made Burklands presence in Micras as a cultural project. One of the reasons was need for Burkland to contact Tiana after their departure to Micras as their main sector. However, this reason was dropped after Tiana started to go back to MicroWiki and the President got Skype. It gained independence from Burkland and it is considered a citizen-run project, like Frazenland is to Kingdom of Zealandia|Zealandia.\n\n==History==\nStorej is a citizen-run cultural project of the government of Burkland. Has with such, the Burklandi government regards an in-character history as important to the project. This often contradicts with other Micras nations history.\n\n===Discovery===\nLeng was discovered in 1929 by the Ultrafascist Party of North Micras, led by Warner Arkontaky, as a way to escape the ban enforced by the National Mussolinist Fascist Party which ruled North Micras. As a result, the Ultrafascist Party took over Leng and its surrounding islands, named it Lengland and declared independence. The War of Independence started between the two forces, and the Antifascist Front in North Micras and Lengland and the Micras World Government-in-Exile joined the fight. Since there was 4 forces fighting against each other, it was one of the worst wars in history. The war was fought for two decades (exact to the nanosecond) until the Antifascists won the war. However, they didnt get control over the rest of North Micras.\n\n===Post-war history===\nThe antifascists led an almost anarchistic government for the first five years, until a dispute between centre-right libertarians and imperialists occurred over who won the Lenglandic elections. This sparked a civil war which lasted for 57 years until the Micronational Cartography Society|MCS decided that libertarian controlled areas would be given independence on April 3, 2011. The nation, called Libertaria, was unpopular among its people as it said that regulating businesses to give mine victims a day off or even making businesses check for mines when it made building was fascist. In addition, they legalize slavery and exercised the dominance of man over women. This gave the Communist Party of Burkland (Burkland was the name of the country used by anti-libertarians) popularity. When the Communists took power, on June 9, 2011, they made a referendum to make Libertaria a socialist republic and rename it to Burkland. This passed with 98.7% of the people supporting (only one voter didnt vote). Libertarians called for a check into the validity of the election and, after the MCS confirmed the votes were the same as the official voting results, Burkland was founded on July 9, 2011. On March 4, 2012, Burkland gained land in Apollonia for economic reasons.<ref>http://theonlineburklandi.wordpress.com/2012/03/04/burklandi-news-332012/ Burklandi News 3/3/2012 - The Online Burklandi, retrieved March 4, 2012.</ref><ref>http://hub.mn/"],
