    "capital": "File:Flag of The Principality of Hains.jpg|thumb|Flag of The Principality of Hains\nhttp://principalityofhains.org/ The Principality of Hains is a Sovereign and Independent Micronation. We are located within the former Indian Territory of North America near the Wabash River.\n\nThe Principality of Hains first came into existence in 1635 when William Haynes (later known as Prince William the first of The Principality of Hains) was crowned as its first prince upon landing in the British Colony of Salem, Massachusetts. \n\nAs more and more Europeans began to settle in the British colonies, Prince William’s successors began to take up residence in the southern colony of Virginia. They later crossed the Appalachian Mountains at the beginning of the nineteenth century and finally in its present location.\n\nWe are a Crowned Democracy which means that our citizens elect their own leaders and approve any new laws. Our royal family provides guidance and stability and their involvement in government is decided by our citizens.\n\n==Territorial Claims==\nThe",
    "currency": "File:Flag of The Principality of Hains.jpg|thumb|Flag of The Principality of Hains\nhttp://principalityofhains.org/ The Principality of Hains is a Sovereign and Independent Micronation. We are located within the former Indian Territory of North America near the Wabash River.\n\nThe Principality of Hains first came into existence in 1635 when William Haynes (later known as Prince William the first of The Principality of Hains) was crowned as its first prince upon landing in the British Colony of Salem, Massachusetts. \n\nAs more and more Europeans began to settle in the British colonies, Prince William’s successors began to take up residence in the southern colony of Virginia. They later crossed the Appalachian Mountains at the beginning of the nineteenth century and finally in its present location.\n\nWe are a Crowned Democracy which means that our citizens elect their own leaders and approve any new laws. Our royal family provides guidance and stability and their involvement in government is decided by our citizens.\n\n==Territorial Claims==\nThe capital city of Santiago de Hains is .001 square miles in size. It is the home of the Royal Palace and is the seat of government. It has warm summers, moderately cold winters, and receives precipitation year round.\n\nHaynes Island is located in the Wabash River, near the capital.  It is uninhabited and is a protective nature preserve.  Its .005 square mile territory is home to cottontail rabbits, fox squirrels, gray squirrels, otters, Canadian geese, osprey, robins, wild turkeys, and a variety of plants.\n\n==Government==\n\nThe Principality has a form of government known as a Crowned Democracy.  When the citizenry is engaged and choose to elect a Prime Minister, then the Principality operates much like a modern democratic state whose monarch participate mainly in a ceremonial sense.  Our Constitution, however, allows the Crowned Prince to rule in the event there is no elected Prime Minister or when the citizen elect the Prince to take on the role of Prime Minister in addition to his role as the Crowned Prince.\n\n==Monarchy==\nFile:Royal Standard of The Principality of Hains.jpg|thumb|The Royal Standard of The House of Hains\nThe royal family consists of the Crowned Prince Paul I, Princess Maura, Princess Heidy, and Prince Jaden.  Prince Paul I is the seventeenth Crowned Prince of Hains.  The Crowned Prince generally assumes a ceremonial role unless he is elected Prime Minister by popular vote, or in the absence of a sitting Prime Minister.\n\n==",
