    "currency": "{{poor}}\nGreenway, officially the Green Pirate Libertarian Social Democratic Republic of the Greenway of Sovereign Persons or only the Greenway of Sovereign Persons (GSP) only, is a micronation project with its base of operations currently in Oregon, United States, adhering to the w:Social_democracy|Social Democratic republic|Democratic Republic system. According to the https://opensocial.at/profile/ghostliberty|Project leader, despite there being no Census as of yet, Greenways population is 2 people (not-including animals). \n\nThis project nation was proclaimed by Ghost Liberty.\n\nAs a social democratic republic, the president of this country is intended to be elected by the people and the President Pro Tempore is elected by the senate, as in the current draft constitution. Currently, the government is shutdown because of no living members to operate it, though Ghost and Locke are both citizens who can use their powers of citizenry to grant citizenship to others and then run an emergency election. \n\n==Etymology==\nThe Name Greenway Comes From the combination of Greenland and Norway, Green/earth-friendly practices, and Cannabis. Greenway also means a corridor of undeveloped land preserved for recreational use or environmental protection, though Greenway plans on some development in a manner that is inter-compatible with nature.\n\n<br />\n\n==Flag==\nFile:Greenway 4k flag.png|thumb|A Greenway flag suggestion made by an Anonymous project contributer.|481x481px\n\n\n\n\n\n\n\n\n\n\n==Location==\nFile:Greenway location.jpg|thumb|A map of Greenways proposed seastead and artificial island location, east of South America.\n\n\n\n\n\n<br />\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<br />\n==History==\nThe history of the founding of Greenway began with the period of time leading up to marijuana legalization and passage in Oregon, where Ghost, the Project founder, lives. The project originally started in 2012, when Ghost Liberty was thinking to themself how they could make all of their money growing cannabis. Cannabis is still illegal in much of the USA where Ghost Liberty lives. He thought to himself that owning their own island would work and began doing research. They could not claim that the law of the nation whose land they were occupying was null and void, the laws of the nation who really owns the island would apply and they could not grow pot. What if they were to create their own country? Ghost did the research and settled on a massive amending of the United States constitution to be the best template for making the laws of the new nation. That is what started Greenway. \n\nGreenway is a micro-nation started by Ghost Liberty, originally as a goal to buy land and start a government so that Ghost would be free to grow all the cannabis they desired and make their living off of it. It eventually evolved into a project for either secession, cession or annexation, or to build an island in the southern Atlantic ocean. The green in Greenway comes not only from the legal cannabis but from green practices and non-exclusively state sector renewable/sustainable industry. Greenway is an open-source government, where transparency is demanded from the government. This is an anonymous operation by, of, and for citizens of the world, to create a better government we might actually be able to depend upon doing the right thing.\n\nAs to where the land was for the nation, they couldnt find anywhere to put the Greenway. They decided on a seamount in the southern Atlantic ocean near South America for a seasteading operation that would incorporate oceanic platforms, and using electro-mineral accumulation along with dredging to form an artificial island. This component of the project is called Atlantis. There are also plans to claim some of Antarctica and the moon as well as mars.\n\n====Greenwegian Declaration of Independence (2015CE)====\nThe Draft New Declaration of Independence was was first worked on around 2015CE. Heres Its Contents: \n\nhttps://operationgreenway.wordpress.com/2017/12/29/declaration-of-independence/ Draft New Declaration of Independence\n\n====Ghost shot down (May 30th 2021CE)====\nMain article: https://opensocial.at/display/59c238fc-1261-e5bf-c40e-062352960575\n\nGhost Liberty was shot by police on May 30 2021CE @ ~2200hh PST in Springfield Oregon, while he was in his home, after they unlawfully entered his home without warrant while they were in the process of placing illegal arrest for a petty Misdemeanor B of an alleged disorderly conduct after he was victim of a criminal trespass by his neighbor who used the opportunity to repair the fence from Ghost’s side of the yard in the recess of his driveway past the front door, and for whom Ghost directly issued warning to not do so again, and was subsequently victim blamed and made to suffer additional injury to his rights. \n\n==Politics and government==\nAccording to the February 18th 2022CE Constitution, the President is the highest office, the President Pro Tempore will be the leader of the Senate, and the Congress will hold consultations for the new law. The President Pro Tempore is elected by the Senate and the President is elected by the people. The position of President Pro Tempore can be taken by a vice-president in certain situations. The Presidential Election is held every October 31, Every One Year, The terms of the President and the Vice-President shall end at noon on the twenty-first day of January, and the terms of Senators and Representatives at noon on the third day of January, and the terms of their successors shall then begin.. The Congress/Assembly is also elected by the people. \n\n====Law and order====\nBased on the 2022CE Draft Constitution, the Laws can be implemented by filing for criminal charges or civil suit in tort for damages. \n\n====Foreign relations====\nblank\n\n==Military==\nThere are xyz# ranks in Greenway, namely; \n\n   • Top\n\n   • high-mid\n\n   • low-mid\n\n   • bottom\n\n==Geography and climate==\nHere will be the eventual average temperature data. For now, we are only a seventh world nation, with no physical territory. Greenway is a 7th world micro-nation, meaning that it exists in “CyberTerra” and therefore under the Montevideo convention, is a defacto nation, though it currently has no other territory secured. The current goal is to use OpenSimulator as a meeting place which is all hosted on I2P to erect the cesidian territories on the internet.\n\nGreenway is a micro-nation project for an artificial island or seastead in the southern Atlantic ocean, with plans to become a fully recognized macro-nation someday. Greenway is a liberal social democratic republic. It is based on the United States historically and is itself mostly a compilation of amendments integrated to the USA constitution at this moment.\n\n====States====\n   • Teslarado\n\n==Economy==\nGreenway plans to be a raw material processing, refinement, manufacturing, research, and development economy, with an emphasis on electrical and mechanical technology and aero/space-flight.\n\n==Culture and media==\nGreenway culture reflects many things classically considered Americana, like the right to bear arms as an individual’s right, Lockean precepts of civil governance, revolutionism, and Individualism, plus Green Pirate Libertarianism, and Social Democratic Republic government, under a sovereign citizenry.\n\n==Government Projects==\n\n====CyberTerra====\nThe goal of establishing an internet presence with a cybernation in OpenSimulator or better. This may be done over I2P for anonymous connections to the Virtual-Reality portion of Greenway before the official Net 2.0 goals are implemented in Greenway.\n\n====Greencash====\nA planned independent fork of Monero and Moneta Verde, merged into one, as an anonymous digital money, designed complete with smart contract capabilities along with an Unstoppable Domain name Service with the primary goal of the domains being to make crypto",
