    "capital": "{{Micras}}\n{{Defunct}}\nJaris (pronounced CHAIR-us) known as the Republic of Jaris, the Kingdom of Jaris, and as the Grand Duchy of Jaris as well as by other names.\n\n== History ==\nFounded by Regis Philban, a/k/a Joe Whit, a/k/a Joe Whittaberg. At first a republic, later a Kingdom. Great respect was always shown to the Founder, who ruled during Jaris entire independent exisitance with one short hiatus. Famous for its military, originally of mounted hordes, later modernized with pink dirigibles. \n\nPossesion of Jaris was disputed between Shireroth and Emperor Jacobus until Jacobus signed over his rights to the Kaiser of Shireroth in late 2005.\n\nNot long after the signing over, Babkha and its Grand Commonwealth felt endangered by the Shirerethian power so close to the terre De Riches. Thus Babkha instigated the Jaris War.\n\n== Description ==\nCentrally located between the Imperium of Cognito and Lac Glacei and Lyrica, Jaris is of extreme strategic importance. After a Cognitan emperor of the Jacobin dynasty launched a failed attack on Lyrica in the first century ASC, the two nations were extremely hostile, although there was a weak pro-Cognitan faction in Lyrica which gained power from time to time, decreasing the intensity of the conflict. But by the fifth century, animosity had extended to the point where the Cognitans were building an armada to take Lyrica by the sea. As part of this plan, the outlying island of Jaris, which was formerly unpopulated, was colonized by a number of Cognitan sailors and military men as an important supply base. As the invasion fleet grew, two more outposts were set up. Yet the invasion failed, miserably, and led to a Lyrican counterattack in which Jaris was taken completely and Lyrican troops pushed all the way to the gates of Ergosum, the Imperial",
