    "capital": "{{Multiple issues|\n{{Dead end|date=July 2023}}\n{{Orphan|date=July 2023}}\n}}\n\n{{Improve}}\n==The Royal Family==\n\n===The Kingdom of Anselmia is lead by its Royal family, with His Majesty, King Tye I as its Sovereign.===\nKing Tye (Tye St. Dennis) Was born in Moose Jaw, Saskatchewan, Canada. He was born a Libra, October 22, 2005 to Patrick Scott St. Dennis, and Ashley Angus (Ambrose).\n\nKing Tye met his future wife, Emilynn St. Dennis (Duchess of Calavantra) at the age of 2 at pre-school. They began dating 12 years later, at the age of 14, and have since been inseparable.\n\nIn April 2020, King Tye lost his best friend, Elly, whom had to be put-down due to health issues. King Tye was a troublemaker as a child, and has had multiple run-ins with Law Enforcement, but has never been charged with a crime.\n\nKing Tye founded the Kingdom of Anselmia on January 5, 2021, created a flag, national anthem, wrote a Constitution, and entered diplomatic relations within 15 hours of forming his Kingdom.\n\n===Her Grace, Emilynn Silvester===\nEmilynn Silvester was born in Moose Jaw, Saskatchewan, Canada. She was born a Libra, October 10, 2005 to James Reid and Kari Silvester-Reid.\n\nThe young duchess met her future Husband, King Tye, at the age of 2, at pre school. They began dating 12 years later, at the age of 14, and have since been inseparable.\n\nHis Majesty, the King realised that Emilynns mother was both Physically and Mentally abusive, and (with the help of his family, and Emilynns father) got her away from her mother, and she began living with her father.\n\nEmilynn Silvester became Duchess Emilynn of Calavantra on January 5, 2021, that day she signed the Constitution of the Kingdom of Anselmia.\n<br /> a\n\n==Constitution of The Kingdom of Anselmia==\nConstitution of The Kingdom of Anselmia\n\nI, King Tye St. Dennis I, In the establishment of The Kingdom of Anselmia, do ordain and establish this Constitution for the Government and the People of The Kingdom of Anselmia. Anyone has the right to discriminate  or protest King Tye of any wrong doing that he does to that end\n\nSection One:\n\nArticle One: The name of this Kingdom shall be ‘The Kingdom of Anselmia’, hereafter referred to as ‘Anselmia’.\n\nArticle Two: The peoples of Anselmia shall make up the population of Anselmia, hereafter referred to as ‘Anselmians’.\n\nSection Two:\n\nArticle One: The Purpose of this Country shall be to establish a Monarchy, Build a Society, and become an Independent Nation.\n\nSection Three:\n\nArticle One: The General Body of The Population must be able to speak, read and write English coherently, as well as know the basic forms of government in Anselmia, and basic history, as well as no persons with a criminal record of murder, rape of terrorism may become a citizen, as well as no history of gang violence, other than that associated with the Itaian/Sicilian La Cosa Nostra, otherwise called “Mafia”.\n\nArticle Two: The Peoples Rights and Freedoms, other than the human rights and freedoms.\n\nThe Right to love whomever they feel, regardless of gender, religion, etc...\n\nRight to full equality to all genders, religions, social clubs, etc…\n\nRight to express oneself, other than in harmful, hateful, or discriminatory ways.\n\nRight to free speech, including written, other than in harmful, hateful, or discriminatory ways.\n\nThe right to protect oneself, their peers, and their personal property by any means necessary.\n\nThe right to rearrange their living location without permission after the age of 15.\n\nThe right to decide about ones personal life, other than in harmful ways.\n\nThe right to destruct property in a flee of fear\n\nThe right to vote, regardless of gender, sexual orientation, race, religion, etc…\n\nThe right to protest, provided there is no harmful or destructive actions.\n\nThe right to resist arrest, provided it is not in a harmful ot destructive way.\n\nThe right to drive underage, provided it is in distress, and only to the nearest emergency station (Police, EMS, Fire)\n\nThe right to bear arms, provided it is purchased from the government\n\nThe right to hide ones identity\n\nThe right to an attorney\n\nThe right to have no response\n\nThe right to exit education, after completion of the 8th year.\n\nArticle two.5: Citizenship may be granted to any person, regardless of Gender, sexual preference or orientation, religion, culture, etc.., provided they agree to follow our laws, and not discriminate on others beliefs.\n\nArticle Three: The Kingdom has the right to revoke citizenship for any criminal offence, provided they are not born into the populace.\n\nArticle Four: A majority vote within the legislative, executive, or judicial form of government for laws may be sent for review by the Royal Family.\n\nSection Four:\n\nArticle One: Each form of government is to meet one per week at a minimum (Online, in person, etc..)\n\nArticle Two: Formal voting takes place every 4–6 months to decide which party will be delegated to transfer conversations between the Royal family and the different forms of government, as well as when asked upon for a court decision, or to decide upon a new law, and or its terms. Note: The vote is NOT the final verdict if the King so chooses.\n\nSection Five:\n\nArticle One: Below that of the royal family consists of those who hold Title Nobilis. The Noble titles, jurisdiction and responsibilities are as follows.\n\nDuke/Duchess- Reserved for the Royal families spouses, children and Head of the Legislature, Head of Provinces.\n\nJarl- Highest achievable Noble Title that can be achieved by Non-Royals. Head of a County.\n\nCount/Countess- Head of a city, working alongside city council.\n\nBaron/Baroness- Head of The Armed Forces, Reports ONLY to the royal family.\n\nLord/Lady- Head of a Town\n\nSir/Dame (Knight): Officer in the Armed Forces.\n\nArticle Two: Legislature\n\nPresident/Prime minister- Head of Legislature, elected official.\n\nPresident: Someone whom has won the Federal Election, and has taken the Noble oath and formed the government in the name of the reigning monarch.\n\nPrime Minister- Someone whom has won the federal election, but has not taken the noble oath, and refused to start a government in the name of the reigning monarch.\n\nSenate/House: Debates on proposed laws on a federal level (federal Laws can ONLY be passed by the king), Representatives for the peoples with concerns to the President/Prime Minister)\n\nProvincial Stative- Debates on proposed laws on a provincial level (Provincial laws can be passed by a Duke/Duchess, Prince/Princess, or King.)\n\nMunicipal Council- Debated on proposed laws on a municipal level (Municiple laws can be passed By a Lord/Lady, Prince/Princess, or the King.\n\nSection Six:\n\nArticle One: Any and ALL laws may be removed/added by the reigning monarch.\n\n==Provinces of The Kingdom of Anselmia==\n",
