    "capital": "{{Defunct}}File:Flag of the Kingdom of New Sweden.svg|thumb|The Flag of the Kingdom of New Sweden\n\nThe Kingdom of New Sweden was a micronation founded on 11 March 2022. The micronation claimed: Parts of Central New Jersey, Marie Byrd Land, Bir Tawil, and Liberland. The former Government of New Sweden was a Constitutional Monarchy, and the Kingdom used to have a Prime Minister as the Head of State, a President, a Vice President, and a Minister of Foreign Affairs. The Second Government was an Absolute Monarchy and the offices of Prime Minister, President, Vice President, and the Minister of Foreign Affairs were made void. The King used to be a ceremonial leader who wielded no power, but then had Absolute Control over all the Government and Nation, until the 30th of March, 2022, when the nation capitulated.\n\n== History ==\n\n===The First New Swedish Civil War===\nOn the 16th of March, 2022, King Elefante I of New Sweden stated that he should have all of the governmental power, and requested that the Minister of Foreign Affairs and the Vice President leave the nation alongside the Prime Minister and President. The Minister of Foreign Affairs and the Vice President then reminded the King that he is only a ceremonial leader, and threatened that a Civil War may occur if the King kicks the Democratic Government out. The King took this as a challenge, and declared war against the Democratic Government, proclaiming New Sweden to be under his Absolutist rule. The war ended on the 22nd of March, 2022, with King Elefante I reigning victorious.\n\n====Declaration of Martial Law====\nAfter the King declared war against the Democratic Government, the Democratic Government declared Martial Law to be in effect until the 1st of May, 2022. The Prime Minister was ousted from the nation due to his unresponsiveness about the Civil War. The Minister of Foreign Affairs became the Colonel of the National Guard, the Vice President became the First Lieutenant of the National Guard, and the President became the Second Lieutenant of the National Guard. The New Provisional Government issued a curfew running from 9:00 to 15:00 that ended on the 18th of March 2022, and another curfew from 7:00 to 15:00 that was planned to have ended on the 1st of May 2022, but ended on the 22nd of March 2022. Both curfews ended with the Capitulation of the Provisional Government\n\n====PS Aerospace Technologies Corporation Scandal====\nOn the morning of 18 March 2022, the Intelligence Wing of the Provisional Government and National Guard of the Kingdom of New Sweden received an anonymous tip that PS Aerospace Technologies Corporation was secretly supplying King Elefantes Army with attack drones. The drones are speculated to be standard PS Aerospace Quadcopters, but re-engineered to have automatic airsoft guns mounted on them. The Intelligence Wing tracked down the CEO of PS Aerospace and interrogated him. The CEO stated that he fully supports King Elefante in the Civil War, and that he has joined King Elefantes Army and was going to be present on the battlefield. The Intelligence Wing then contemplated on whether to arrest the CEO or not. The Intelligence Wing elected not to arrest him in order to avoid a Hostage Crisis. The CEO was then taken and dropped at the US-New Swedish border. After the interrogation, the Provisional Government and National Guard sent out a notice to the citizens of New Sweden informing them of the scandal and to not do business with PS Aerospace, its CEO, or its employees. The National Guard gained two new recruits due to the scandal.\n\n====Capitulation of the Provisional Government of the Kingdom of New Sweden====\nOn the 22nd of March, 2022, the Provisional Government and National Guard of the Kingdom of New Sweden capitulated. This capitulation was due to a combination of unorganization within the National Guard, King Elefante Is Army capturing many territories, the PS Aerospace Scandal, as well as an inability for the Provisional Government and National Guard to govern the Kingdom of New Sweden effectively.\n\n====The Re-installment of King Elefante I====\nAfter the Capitulation of the Provisional Government of the Kingdom of New Sweden, New Sweden went through a brief period of Anarchy. No crimes were reported to have happened during the brief period. King Elefantes Army was notified of the capitulation, and marched towards the",
